  {document_id: 104, type: "DocumentPart::HtmlContent", title: "", content: "In case you haven't noticed, there's a silent movement happening in the sport of motocross. Over the past few years, Alta has been making major strides in manufacturering a race-ready electric motocross bike. And after spending numerous days at the track with the Alta crew, Darryn Durham decided to put the machine to the test, racing in the annual TransWorld Motocross Slam event at Milestone MX Park. The Slam race is unlike any other, pitting 10 top pros against each other in two five-lap motos with the winner taking the $5,000 lion's share of the $10,000 pro purse. Practice for DD went relatively smoothly, as he went down a couple times while pushing the proverbial envelope aboard the Redshift, but in the end, he made it into the main event. Against the 10 other gas powered MX bikes, Darryn held his own, stayed out of trouble—for the most part—and turned in a solid finish in the Redshift's first official motocross race. The Redshift stood up to the abuse, proving that the future looks bright for the electric movement. Relive the weekend with some killer photos from the Alta crew.", additional_data: {}, display_order: 1, hidden: false, created_by: nil, pane: "main"},
  {document_id: 106, type: "DocumentPart::Slideshow", title: "", content: "", additional_data: {}, display_order: 0, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 106, type: "DocumentPart::HtmlContent", title: "John Hateley", content: "<p>Actually John started working in films as an actor at the age of three, but by the age of ten his energy and passion had turned to motorcycles. In 1966 at fourteen he won the AMA District 37 100cc TT Championship. At fifteen he was holding his own with the fastest racers in So Cal. Racing was born and bred into him.</p><p>Back in the 70’s it was hard to make a living as a racer despite being one of the fastest pros in the country. So he came full circle, going back into film work, this time as one badass stuntman. But that competitive fire never goes out, as good friend and fellow stuntman Gene Hartline says about John, “He’s a racer. If you want a definition of what that is, he’s it, he’ll race you to the bathroom.”</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
