  {document_id: 114, type: "DocumentPart::HtmlContent", title: "Ricky Diaz", content: "The first time we met Ricky, of course, was at a local track – Milestone. We loved his style and we got to know him pretty well that day. He’s been one of us ever since, a So Cal local. The kid can throw it down.", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 115, type: "DocumentPart::Slideshow", title: "", content: "", additional_data: {}, display_order: 0, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 115, type: "DocumentPart::HtmlContent", title: "Ricky Johnson", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 116, type: "DocumentPart::Slideshow", title: "", content: "", additional_data: {}, display_order: 0, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 116, type: "DocumentPart::HtmlContent", title: "Terry Cook", content: "Terry Cook tells it like it is, he pushes the limits, and has that moto attitude. It serves him well, whether he’s racing his dirt bike or his mountain bike. This attitude we love so much is one of calm confidence and a belief in excellence, that’s Terry Cook personified.", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 117, type: "DocumentPart::Slideshow", title: "", content: "", additional_data: {}, display_order: 0, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 117, type: "DocumentPart::HtmlContent", title: "Willy Simons Jr.", content: "Willy Jr. was born with moto DNA in his blood, handed down from his dad Willy Simons Sr. He calls Simi Valley his home, but he mostly lives in the dirt of So Cal's many motocross venues. Keep an eye on this kid, he's one of our moto crew.", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 118, type: "DocumentPart::Slideshow", title: "", content: "", additional_data: {}, display_order: 0, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 118, type: "DocumentPart::HtmlContent", title: "Brian Palmer", content: "We’ve known Brian for years, he’s the realtor to most of the motoheads we know. And he’s been a fixture at the dirt bike race we put on called Day in the Dirt. He always has something smart to say, makes us love his style and his sense of humor. Brian and Tami are our kind of people.", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 119, type: "DocumentPart::Slideshow", title: "", content: "", additional_data: {}, display_order: 0, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 119, type: "DocumentPart::HtmlContent", title: "Robbie Wageman", content: "Robbie lives in our hometown, Newhall, CA. The Wageman moto family has made its mark here. Rob Dog, as his friends call him, is one of fastest young racers around. You can find him tearing up the local tracks around So Cal and competing in some of the biggest and coolest races in the U.S. He is one of our local boys.", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
