  {document_id: 145, type: "DocumentPart::HtmlContent", title: "Emil Johansson", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 146, type: "DocumentPart::HtmlContent", title: "Caroline Buchanan", content: "<p>Fasthouse welcomes Lifestyle/BMX/MTB global athlete Caroline Buchanan (Australia) to the team.</p><p>Mike Redding stated, “We are stoked to have Olympian and multiple World Champion Caroline on the team doing lifestyle projects and riding at global events for us. She will also help us design our women’s line in the future. She fits our brand vibe: Speed, Style, and Good Times!”</p><p>Caroline will be at select BMX and MTB events, and bike parks around the world.</p><p>Go to Fasthouse.com and check out our current lifestyle clothing line. Keep an eye out for our MTB line and Bell helmets co-lab dropping this spring. Give Caroline a follow on her IG account&nbsp;<a target=\"_blank\" rel=\"nofollow\" href=\"https://www.instagram.com/cbuchanan68/\">@cbuchanan68</a>.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 147, type: "DocumentPart::Slideshow", title: "", content: "", additional_data: {}, display_order: 0, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 147, type: "DocumentPart::HtmlContent", title: "", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 148, type: "DocumentPart::Slideshow", title: "", content: "", additional_data: {}, display_order: 0, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 148, type: "DocumentPart::HtmlContent", title: "Ricky Johnson", content: "Racer/Racer, Rick Johnson. We are proud of the fact that we are friends with Ricky. Yes, he’s a multi-time champion, not only on two wheels but also on four. But for us, he helped make an event we put on once a year called A Day in the Dirt so cool. In 1998 Ricky came to LACR for the first one and partnered up with legendary desert racer, J.N. Roberts for the team race. That was a huge deal for us. And he’s been with us ever since, we love the bad boy of motocross.", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 149, type: "DocumentPart::Slideshow", title: "", content: "", additional_data: {}, display_order: 0, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 149, type: "DocumentPart::HtmlContent", title: "Doug Henry", content: "Doug Henry personifies “Badass”. One of the greatest dirt bike racers ever, his talents being right up there with the greats. His career spans super highs with big wins in motocross and supercross and devastating lows with injuries culminating with a spinal cord injury resulting in partial paralysis. But Doug Henry is unstoppable, he continues to ride and race on his custom built dirt bike, that’s where he finds his “happy place.” He is the epitome of a true racer. He’s one of our heroes.", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 150, type: "DocumentPart::Slideshow", title: "", content: "", additional_data: {}, display_order: 0, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 150, type: "DocumentPart::HtmlContent", title: "Roger De Coster", content: "If someone in the world of motocross mentions “The Man” you know they’re talking about Roger. He is perhaps the best-known racer from the first 50 years in the sport of motocross. Born in Belgium, Roger came late into riding, getting his first race bike at 17. But he was born with the racing DNA, by 19 he had won the junior 500cc Belgium Motocross title, the Belgium Trials championship, and earned a gold in the ISDT. It was onward and upward from there, winning so many titles it’s impossible to list them here. America got to meet Roger for the first time in 1967 when Jim McKay interviewed him on Wide World of Sports at the famous Hopetown Grand Prix in Simi Valley, California. Back in SoCal today, he is still a force to be reckoned with, he is Team Manager of the Red Bull KTM Factory Team in the U.S. A true legend, “The Man”.", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 151, type: "DocumentPart::Slideshow", title: "", content: "", additional_data: {}, display_order: 0, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 151, type: "DocumentPart::HtmlContent", title: "", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 152, type: "DocumentPart::Slideshow", title: "", content: "", additional_data: {}, display_order: 0, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 152, type: "DocumentPart::HtmlContent", title: "Mert Lawwill", content: "Mert is remembered most for the role he played in Bruce Brown’s iconic “On Any Sunday.” The film turned the world onto TT racing where Mert was king, winning 17 National Championships. Mert’s contribution to mountain bikes and prosthetics for racers is supercool.", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 153, type: "DocumentPart::Slideshow", title: "", content: "", additional_data: {}, display_order: 0, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 153, type: "DocumentPart::HtmlContent", title: "Joel Robert", content: "<p>For most Americans, the first time we laid eyes on Belgian rider Joel Robert (pronounced RoBear) was in 1967 when he was racing the Classic Hopetown Grand Prix in southern California, filmed by Bruce Brown and shown on ABC's Wide World of Sports.</p><p>Robert was a bigger than life character, unbelievably fast, eccentric, undisciplined, and a charming prankster. He won 6 World Championships, 5 in a row. He loved his beer and smoked, often while sitting on the line waiting for the start, and as the story goes on one of these occasions he put the cig out on the helmet of the rider next to him. He then proceeded to win the race.</p><p>Stories abound, all of them reinforcing our belief that Joel Robert is – the Godfather of Motocross.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 154, type: "DocumentPart::Slideshow", title: "", content: "", additional_data: {}, display_order: 0, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 154, type: "DocumentPart::HtmlContent", title: "Kenny Zahrt", content: "<p>“Man, motocross for me has been my life – it’s all I know, and still all I do! I have always been around motorcycles, worked on motorcycles and ridden motorcycles. That’s it, that’s what I did and still do!” So Cal born, local boy at Indian Dunes, he was one of the most colorful and cool characters racing motocross and supercross.</p><p>In 1974 he won a National at Redbud on a Bultaco and in 2013, still living the life, he raced at Red Bull Day in the Dirt 16.</p><p>Kenny passed away Friday, November 14th, 2014. He is missed. </p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 155, type: "DocumentPart::Slideshow", title: "", content: "", additional_data: {}, display_order: 0, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 155, type: "DocumentPart::HtmlContent", title: "", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
