  {document_id: 157, type: "DocumentPart::Slideshow", title: "", content: "", additional_data: {}, display_order: 0, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 157, type: "DocumentPart::HtmlContent", title: "", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 158, type: "DocumentPart::Slideshow", title: "", content: "", additional_data: {}, display_order: 0, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 158, type: "DocumentPart::HtmlContent", title: "", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 159, type: "DocumentPart::Slideshow", title: "", content: "", additional_data: {}, display_order: 0, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 159, type: "DocumentPart::HtmlContent", title: "Malcolm Smith", content: "<p>Possibly one of the coolest scenes in the best motorcycle movie ever made, “On Any Sunday” was Malcolm Smith roaring back into town In the Elsinore Grand Prix. He was alone, not one of the other 1499 riders was in sight.</p><p>1998 AMA Hall of Famer, Malcolm was a classic example of a Sunday motocross competitor. Fast, furious and tireless, he was the “best of the best” and it earned him a starring role in Bruce Brown’s, “On Any Sunday.” His talent was unmatched, the rougher and tougher the event, the more Malcolm shined. He knew how to hang it out with a style all his own, cool, calm, collected and grinning ear to ear.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 160, type: "DocumentPart::Slideshow", title: "", content: "", additional_data: {}, display_order: 0, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 160, type: "DocumentPart::HtmlContent", title: "Dave Ekins", content: "Dave was a true pioneer. Just the name Ekins alone (Dave or brother Bud), reverberates through the motorcycle racing community. Dave was cutting new trails whether it was through the hills from Mulholland to the ocean or 1000 miles across the Mexican desert from Tijuana to La Paz. Thank you for leading the way.", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 161, type: "DocumentPart::Slideshow", title: "", content: "", additional_data: {}, display_order: 0, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 161, type: "DocumentPart::HtmlContent", title: "", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
