  {document_id: 168, type: "DocumentPart::HtmlContent", title: "Footer", content: "\r\n    <div class=\"row\">\r\n        <div class=\"col-lg-5 col-md-4 footer-left\">\r\n            <h3><img src=\"http://thefasthouse.com/static/img/fasthouse-logo-white.png\" alt=\"Fasthouse\"></h3>\r\n            <p class=\"footer-links\">\r\n\t\t\t\t<a href=\"/\">Home</a> · \r\n\t\t\t\t<a href=\"http://store.thefasthouse.com/\">Store</a> · \r\n\t\t\t\t<a href=\"/the-scene\">The Scene</a> · \r\n\t\t\t\t<a href=\"/videos\">Videos</a> · \r\n\t\t\t\t<a href=\"/subscribe\">Subscribe</a> · \r\n\t\t\t\t<a href=\"/crew\">Crew</a> · \r\n\t\t\t\t<a href=\"/legends\">Legends</a> · \r\n\t\t\t\t<a href=\"/when-rules-were-few\">History</a></p>\r\n            <p class=\"footer-links\"><a href=\"http://store.thefasthouse.com/pages/privacy-policy\">Privacy</a> · <a href=\"http://store.thefasthouse.com/pages/terms-conditions\">Terms</a></p>\r\n            <div class=\"footer-icons\"><a href=\"http://www.facebook.com/fasthousebrand\" target=\"_blank\"><i class=\"fa fa-facebook\"></i></a>&nbsp; <a href=\"http://instagram.com/fasthouse_\" target=\"_blank\"><i class=\"fa fa-instagram\"> </i></a>&nbsp; <a href=\"https://www.youtube.com/user/elrodracing/featured\" target=\"_blank\"><i class=\"fa fa-youtube\"></i></a></div>\r\n        </div>\r\n        <div class=\"col-md-4 footer-center\">\r\n            <table>\r\n                <tbody>\r\n                    <tr>\r\n                        <td><i class=\"fa fa-map-marker\"></i></td>\r\n                        <td>26525 Ruether Ave.<br>Santa Clarita, California, USA 91350</td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td><i class=\"fa fa-phone\"></i></td>\r\n                        <td>661.347.7950</td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td><i class=\"fa fa-dot-circle-o\"></i></td>\r\n                        <td><a href=\"/fasthouse-dealers\">Find a Dealer</a></td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td><i class=\"fa fa-envelope\"></i></td>\r\n                        <td><a href=\"/contact-fasthouse\">Contact Fasthouse</a></td>\r\n                    </tr>\r\n                </tbody>\r\n            </table>\r\n        </div>\r\n        <div class=\"col-lg-3 col-md-4 footer-right\"><a href=\"http://www.bellhelmets.com/\" target=\"_blank\"><img style=\"padding: 10px;\" src=\"https://fasthouse.s3.amazonaws.com/media/uploads/logo-bell.png\" alt=\"Bell Helmets\"></a> <a href=\"https://www.redbull.com/\" target=\"_blank\"><img style=\"padding: 10px;\" src=\"https://fasthouse.s3.amazonaws.com/media/uploads/logo-redbull-stacked.png\" alt=\"RedBull\"></a> <a href=\"http://www.805beer.com/\" target=\"_blank\"><img style=\"padding: 10px;\" src=\"https://fasthouse.s3.amazonaws.com/media/uploads/logo-805-shield.png\" alt=\"805 Beer\"></a> <a href=\"http://www.vonzipper.com/\" target=\"_blank\"><img style=\"padding: 10px;\" src=\"https://fasthouse.s3.amazonaws.com/media/uploads/logo-vz.png\" alt=\"Von Zipper\"></a></div>\r\n    </div>\r\n    <p class=\"footer-company-name\">© 2018 Fasthouse</p>", additional_data: {}, display_order: 2, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 168, type: "DocumentPart::HtmlContent", title: "The Scene Header", content: "", additional_data: {}, display_order: 3, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 168, type: "DocumentPart::HtmlContent", title: "Stories Header", content: "<div class=\"page-ctr\">\r\n<div class=\"page-title-centered\">\r\n  <h2>Stories</h2>\r\n  <h5>Fasthouse Stories showcases the epic lifestyle and good times for all things dirt bike.</h5>\r\n</div>\r\n</div>", additional_data: {}, display_order: 4, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 168, type: "DocumentPart::HtmlContent", title: "Crew Header", content: "<div class=\"page-header\">\r\n<img src=\"https://cdn.shopify.com/s/files/1/0259/6401/files/slider-placeholder.jpg?15459293421403788171\"/>\r\n<h2>Crew</h2>\r\n</div>", additional_data: {}, display_order: 5, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 168, type: "DocumentPart::HtmlContent", title: "Legends Header", content: "<div class=\"page-header\">\r\n<img src=\"https://cdn.shopify.com/s/files/1/0259/6401/files/slider-placeholder.jpg?15459293421403788171\"/>\r\n<h2>Legends</h2>\r\n</div>\r\n<div class=\"page-ctr\">\r\n<p>We are Fasthouse, we represent a lifestyle that is dynamic, energized and full of passion for motorcycles and motorcycle racing – be it motocross, flat track, racing across the desert or simply taking a quick run up Mulholland on a weekend.  We want to introduce you to some of our moto family and friends and invite you to live the life we love.</p>\r\n</div>", additional_data: {}, display_order: 6, hidden: nil, created_by: nil, pane: "main"},
