  {document_id: 15, type: "DocumentPart::HtmlContent", title: "", content: "<p>We came across this bad ass video from Shimano of Carson Storch shredding and telling his story about mountain biking and what it means to him. Check it out and watch for some Fasthouse love, as the Red Bull rider flies the FH colors with pride.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 16, type: "DocumentPart::HtmlContent", title: "", content: "<p>Competing in X Games is a dream for most motocross riders, but riding dirt bikes on one of the biggest stages for action sports is something that not many riders get to do. For Tyler Bereman, his trip to X Games this year was a solid team effort. From everyone at Fasthouse designing TB&rsquo;s custom jersey, helmet, and overall look for the event to Airtrix bringing the helmet design to life and Robbie Brown building the baddest bike in the pits, TB had a tight knit team of people in his corner, and it showed. After earning a bronze in Best Whip, Bereman went into Big Air Quarter Pipe looking for gold. Following a huge air, TB was sitting pretty in the top spot until Colby Raha uncorked one of the highest airs out of the quarter pipe to date, bumping Tyler down to silver. For all involved, X Games was a resounding success&mdash;TB came home with some hardware, the Fasthouse gear looked the coolest, and most of all, the boys had a good time. Fasthouse tagged along with TB for the entire event, after parties, and good times. Check it out.</p>\r\n<p><em>Video by Aran Eversman</em></p>\r\n<p><em>Photos by Garth Milan</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 17, type: "DocumentPart::HtmlContent", title: "", content: "<p>Where ever the Fasthouse crew goes, good times follow. And our time in Mammoth this year for the 50th Mammoth Motocross was nothing short of epic. Racing, sketchy pit bike action, and cold brews with buddies were just a few of the highlights. Enjoy the video, reliving the good times at 8,000 feet, but look closely to see some of the new gear in action. When you&rsquo;re done, check out the gear for yourself by <a href=\"https://store.thefasthouse.com/\" target=\"_blank\">CLICKING HERE</a> to head into our online store.</p>\r\n<p><em>Video by Brendan Lutes</em></p>\r\n<p><em>Photos by Max Mandell</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 18, type: "DocumentPart::HtmlContent", title: "", content: "<p>X Games is this weekend and Tyler Bereman is pinning it to Minneapolis right now. But in the meantime, we came across this rad gallery of his new bike built by Robbie Brown on ESPN from moto photographer Chris Tedesco. <a href=\"http://xgames.espn.com/xgames/gallery/19974003/\" target=\"_blank\">CLICK HERE</a> to check out the entire gallery. It's drool worthy.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 19, type: "DocumentPart::HtmlContent", title: "", content: "<div class=\"clip_details-description description-wrapper iris_desc\">\r\n<div class=\"iris_desc-content description-content\" dir=\"auto\">\r\n<p class=\"first\">Andrew Hertzler is the newest addition to the Fasthouse crew, and one fast up-and-coming mini bike racer. During this year's 50th Annual Mammoth Motocross, we followed him around for a day at the track to get his perspective on racing, life, and good times.</p>\r\n<p><em>Video by Mike LeGrand</em></p>\r\n<p><em>Photos by Max Mandell</em></p>\r\n</div>\r\n</div>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 20, type: "DocumentPart::HtmlContent", title: "", content: "<p>The 50th Annual Mammoth Mountain Motocross has come and gone, and we're still reliving the good times we had up on the mountian, riding our dirt bikes at 8,000 feet. This year's event was unforgettable and capped off with a sketchy pit bike race in the Mammoth Village followed by the big after party. <a href=\"http://www.thefasthouse.com/stories/racing-high-at-8-000-ft\" target=\"_blank\">CLICK HERE</a> or the link below to check out a massive Fasthouse Photo Story from the event.</p>\r\n<p><a href=\"http://www.thefasthouse.com/stories/racing-high-at-8-000-ft\" target=\"_blank\">Fasthouse Photo Story | 50th Mammoth Motocross</a></p>\r\n<p><em>Photos by Max Mandell and Brendan Lutes</em></p>\r\n<p><a href=\"/stories/good-times-at-8-000-ft\"><img src=\"/static/media/uploads/btn-photostory.png\" target=\"_blank\" /></a></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 21, type: "DocumentPart::HtmlContent", title: "", content: "<p>The first weekend&mdash;and most fun for all the old guys&mdash;at the 50th Annual Mammoth Motocross wrapped up with some unforgettable good times, close racing, and plenty of ice cold 805 beers. Being that most, if not all, of the Vet racers have to clock in at work on Monday morning, the Vet weekend is usually more about having a good time than setting the world on fire with lap times, big whips, and risky passes. Sure, the racing can get intense, but once the checkered flag waves, the boys can be seen high-fiving each other and laughing about the prior battle.</p>\r\n<p>Rather than bore you, though, about the mundane details of the weekend, we thought some bullet points, and a ton of bitchin' photos would be a better fit.</p>\r\n<p><strong>MAMMOTH VET WEEKEND:</strong></p>\r\n<p>-It's tough to come off the couch and pound out 10 laps at 8,000 feet elevation. Sean Collier did his best, though, leading each moto until about lap six when his tongue got caught in his spokes</p>\r\n<p>-Darryn Durham dominated the Support Class on a Manny Gasper Racing YZ450F, setting some blazing lap times along the way. His last lap of the weekend was a blistering 1:58.5</p>\r\n<p>-Fasthouse went 1-2-3 in the Support Class. Durham, RJ Wageman, and Ikua Hughes completed the podium</p>\r\n<p>-805 Beer is best served cold after a long, hot moto</p>\r\n<p>-Aside from some bumps and bruises, everyone left the mountain in one piece</p>\r\n<p>-Kenny Alexander won practice. Like literally led every lap until the red flag was waving</p>\r\n<p>-Caile Noble gave vintage Smoke And Fire winner Nick LaPaglia a run for his money, finishing only bike lengths behind the CZ rider at the finish</p>\r\n<p>-Olympic downhill skier Daron Rahlves and FH crew member Terry Cook had epic battles in the 40-Plus Class</p>\r\n<p>-Arik Swan found that bears do like cocktails as much as we do</p>\r\n<p>-Now in its third year, the Smoke And Fire race was stacked with two gate drops</p>\r\n<p>-Mammoth still gets just as rough as it used to 50 years ago</p>\r\n<p>-The new whoop section in the back was a lot of fun</p>\r\n<p>-The new Fasthouse gear turned plenty of heads. Check out the online store once we're all back from the mountain next week</p>\r\n<p>-Dirt bikes are fun</p>\r\n<p><em>Photos by Max Mandell</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 22, type: "DocumentPart::HtmlContent", title: "", content: "<p>We're now less than a week away from the festivities beginning up in Mammoth Lakes, California, for the 50th running of the Mammoth Motocross race, and we're all in full prep mode around the Fasthouse headquarters. To celebrate, Mammoth Mountain put together this rad short film, packed full of history and interviews from some of the race's most prolific racers and motocross industry insiders. Check it out, and we'll see you on the mountain next weekend. For more information on the event, <a href=\"http://www.mammothmotocross.com/\" target=\"_blank\">CLICK HERE</a>.</p>\r\n<p><em>Video by Joe Carlino</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 23, type: "DocumentPart::HtmlContent", title: "", content: "<p>This year's Glen Helen National was one for the books. Between Justin Hoeft finishing a very impressive 14th overall in his first-ever 450 Class race and the bitchin' FMF Two-Stroke Invitational, the GH race was one that we won't soon forget. To document everything, we've put together a rad <a href=\"http://www.thefasthouse.com/stories\">Fasthouse Story</a>, which you can check out by clicking <a href=\"http://www.thefasthouse.com/stories/unforgiving-monster\">THIS LINK</a>.</p>\r\n<p><em>Photos by Brendan Lutes</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 24, type: "DocumentPart::HtmlContent", title: "", content: "<p>The wait is finally over... The long sought after Mixin' Gas And Haulin' Ass jersey worn by the crew at this year's Two-Stroke World Championships is available. And to celebrate, we've been holding onto this super rad Super 8 footage shot by Joe Carlino. Check it out and don't forget to click through to the online store to get your own jersey. We'll be rocking it again at this weekend's Glen Helen National.</p>\r\n<p><a href=\"https://store.thefasthouse.com/collections/new/products/mixin-gas-haulin-ass-jersey-white\" target=\"_blank\">CLICK HERE</a> to purchase the jersey.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 25, type: "DocumentPart::HtmlContent", title: "", content: "<p>One more month&hellip; We&rsquo;re counting the days until the 50<sup>th</sup> running of the historic Mammoth Mountain Motocross. Last year&rsquo;s race was one for the books, and we spent the entire 10 days on the mountain attending every event from the motocross races to bowling to even tricycle racing. After getting into a slight bit of trouble last year&mdash;burnouts and mid-moto switch-a-roos are generally frowned upon by the powers that be&mdash;we&rsquo;re on probation, but we&rsquo;re still planning on having one hell of a good time with some of our closest friends.</p>\r\n<p>The Vet weekend is where most of us here at Fasthouse get to shine. It&rsquo;s the first weekend before all the fast kids hit the track&mdash;when the old guys get to spin laps, eat roost, and toss back cold ones at the end of the day. One of our favorite races, though, is the Smoke And Fire event, held on the first weekend, but the entire time up there is spent enjoying two wheels at one of the most beautiful tracks this side of the Mississippi. If you haven&rsquo;t been, do yourself a favor and make the trek up the mountain. In the meantime, check out the rad video from last year. We&rsquo;ll be posting more content from 2016 over the next few weeks.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 26, type: "DocumentPart::HtmlContent", title: "", content: "<p>Rather than the regular grind of pounding out laps at the Supercross track this past winter, Darryn Durham decided to head to the hills, build jumps, and have a ton of fun. The latest video from The Viewing boys portrays the days that we all live for on two wheels, and reveals what DD was up to while all the other pros were spinning laps and hoping on planes each weekend for the traveling circus of Supercross.</p>\r\n<p><em>Photos by Brendan Lutes</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 27, type: "DocumentPart::HtmlContent", title: "", content: "<p>Back in the early 70s, when kids couldn&rsquo;t make it out to the motocross tracks, they were picking up bicycles, converting them to custom BMX bikes, and racing around dirt fields or neighborhoods, starting an underground culture of youngsters growing up on two wheels. Around that time, Ernie Alexander decided to start the National Bicycle Association, giving the kids an organized racing series to compete in&mdash;the rest is history. That&rsquo;s when the fast kids became rock stars, as BMX spread across the country. And the NBA made that possible.</p>\r\n<p>Today, the NBA is no longer putting on races. But as a way of honoring Ernie Alexander, one of the Godfathers of BMX, old and young alike gathered at Valley Relics Museum for a reunion. Tommy the owner of the joint is an old BMXer, so who better to host the first annual get together for those who want to remember and reminisce about their good-old BMX days. The museum had a great display of classic bikes, old issues of Ernie&rsquo;s Bicycle Scene newspaper, and outside was a sea of BMX parts, legendary bikes, and memorabilia from yesteryear. The coolest thing was, though, that it was a place for like-minded people to come together and shoot the shit.</p>\r\n<p>Today, Ernie cruises into Fasthouse every morning around 8:00am to tell his son Kenny how to run the shop.</p>\r\n<p><em>Photos by Brendan Lutes</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 28, type: "DocumentPart::HtmlContent", title: "", content: "<p>It's that time of year. When the flowers bloom and the temperatures begin to climb. After all the rain we got this winter in SoCal, the weather is now perfect and riding season is in full swing. With this in mind, we loaded up the vans, headed up the coast, and set up shop at our favorite track&mdash;Zaca Station. Located just north of Santa Barbara, Zaca's picturesque location, prime dirt, and flowing layout is heaven for dirt bike riders; and it was the perfect location for the first annual Spring Fling. Everyone rode until their hands were sore, ate until they couldn't walk, and drank ice cold 805 beers until... well, there weren't anymore left in the ice chest. It was a day to remember. Relive it in the accompanying video and photos.</p>\r\n<p><em>Video by Brendan Lutes</em></p>\r\n<p><em>Photos by Max Mandell and Danny Osterman</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 29, type: "DocumentPart::HtmlContent", title: "", content: "<p>Leticia Cline is a women who has experienced just about everything life has to offer. From motorcycles to flying water jet packs to even working for Donald Trump&mdash;before he became President&mdash;she isn't scared to take on new challenges. In this episode of After Hours, Sean talks to her about all of this, but more importantly how motorcycles have impacted her life and her plans for the future.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 30, type: "DocumentPart::HtmlContent", title: "", content: "<p>We're always down for a good time on two-wheels, and what better way than re-living the days when two-strokes ruled the roost at the annual MTA Two-Stroke World Championships at Glen Helen Raceway. Every year, the FH crew heads out to San Bernardino to attend the event for some good old fashion good times on pre-mix burning machines. This year, Sean Collier elected to park \"The Beast\" in leu of throwing a leg over a modern TM300. His day didn't go to plan, though, as a crash in the first moto left him sore and battered for the rest of the day. He still managed to put in an impressive top-10 ride, finishing 18-8 for 10th overall. In the 125 Pro Class, young racer Robbie Wageman dominated both motos, taking his tricked out YZ125 to wire-to-wire victories in both motos. Check out the quick re-cap video to see what the day was all about.</p>\r\n<p><strong>RESULTS:</strong></p>\r\n<p><br /><strong>Open Pro:</strong></p>\r\n<p>1. Ryan Surratt (Hon)</p>\r\n<p>2. Michael Sleeter (KTM)</p>\r\n<p>3. Jon Ames (Yam)</p>\r\n<p><strong>125 Pro:</strong></p>\r\n<p>1. Robbie Wageman (Yam)</p>\r\n<p>2. Carson Carr (Yam)</p>\r\n<p>3. Robbie Schott (TM)</p>\r\n<p></p>\r\n<p><em>Photos and Video by Brendan Lutes</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 31, type: "DocumentPart::HtmlContent", title: "", content: "<p>Our friends over at FMF just released the first episode in what is sure to be a must-watch series entitled Flying Machine Stories.</p>\r\n<p>FMF Racing introduces Flying Machine Stories &ndash; An inside look of the roots of the company and brand and people that share the same passion for roost, metal and twisting throttles.<br /><br />We want to understand why you ride? Is it the mental escape? Is it the feeling of flight? Is it capturing the unknown?<br /><br />For certain it is the sensation you feel at the end of the day. The ride makes us more aware of who we are. The trail transports us to an indescribable state of mental and physical satisfaction.<br /><br />We need to see beyond the racetrack to feel the fabric binding everyone who rides. We want to share your story. This is the first chapter in a series where we will dig deep, and find our roots.<br /><br />The journey opens with WLF Enduro. WLF is a hardcore off-road crew who have gained a global following through sharing their backcountry adventures. The story begins here at the Flying Machine Factory. Watch the video, and meet the Wolfpack.<br /><br />Head over to the site to view the whole story: <a href=\"http://flyingmachinefactory.com/wlf-episode-001/\" target=\"_blank\">CLICK HERE</a></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 32, type: "DocumentPart::HtmlContent", title: "", content: "<p>When I was a kid, my entire family would pile into our Mini Wini, with the flatbed trailer in tow, bound for a weekend in the wide-open Southern California Mojave Desert. Trips like that were some of the best memories of my childhood&mdash;trying to look like my heroes while I chased my dad over the rocks, whoops, and sand. I still remember the day that we stopped on the side of the trail&mdash;I was on my CR80; my dad aboard his KDX200&mdash;and he said to me with honest excitement in his voice, &ldquo;Wow, you&rsquo;re gettin&rsquo; fast. Every time I looked back to check on you, you were right behind me.&rdquo; As the years went on, I progressed, racing took over, I soon went off to college, and our regular trail riding trips became fewer and fewer. But to this day, every time we get a chance to ride together, I never pass it up. Riding with my dad is one of coolest things I get to do on a motorcycle. And when we got the invite from our good friends Larry Atnip and Massis Chahbazian to attend the annual Best In The Desert Nevada 200 Trail Ride, we couldn&rsquo;t pass it up.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The Nevada Trail Ride has been going on for over 30 years. Originally promoted and organized by the late Casey Folks, along with his son Darryl and off-road legend Scott Harden, the ride covers 200 miles of picturesque Nevada terrain just north of Las Vegas, and as an invite-only ride, the number of riders is usually kept at the perfect amount for the miles of single-track trails and abundant good times. Since I wanted to enjoy every moment of the ride, though, I decided to leave my professional camera behind&mdash;something that was tough to do&mdash;and just enjoy the experience with my dad, stopping only to bench race, drink some water, and take casual cell phone pictures.</p>\r\n<p>Being that it was our first year attending for my dad and I, we didn&rsquo;t really know what to expect, but as I drove to the small town of Caliente on the first day to meet up with my dad and everyone else, I began to climb over the mountain that led into town, and the snow on the ground became more and more abundant. After checking in, we unloaded our bikes, geared up, and attended the rider&rsquo;s meeting before embarking on the first day of riding, which was without a doubt going to be cold and interesting.</p>\r\n<p>My dad and I left base camp together and rode down a transfer road with everyone else before jumping into a soft snow covered sand wash. Having little to no experience in the snow, I watched my dad in front of me pinned aboard his CRF250R with his feet off the pegs, paddling through the snow, and I thought to myself, &ldquo;Wow, if this is how difficult snow is, this is going to be quite the day&hellip;&rdquo; But after a couple falls, and stopping to put on some rubber gloves to keep my hands warm, the sandy trail soon wound into single track through the trees. After that, the entire day was spent cutting in fresh tracks and enjoying the scenery. With that said, though, the day wasn&rsquo;t without sketchy moments. If I got out of the main line, I found myself all over the countryside on more than one occasion, bouncing off rocks like a ping-pong ball. I also got the chance to see a guy wrap himself around a tree after he hit a hidden rock, swapped out, and promptly high-sided directly into the side of an immoveable nearby tree. It all goes into what makes trail riding so fun. As long as you can laugh about it later, it was a good idea.</p>\r\n<p>The next day, we woke up bright and early to blue bird conditions and perfect springtime temperatures. But while I shoveled in some fresh scrambled eggs with everyone else at the local American Legion Post, I couldn&rsquo;t help but wonder how muddy it would get once the snow began to melt. As we made our way into the mountains during the first part of the day, we wound through perfect desert single track. After hitting the gas stop, though, the conditions changed drastically, as we began to hit melting snow and supremely muddy conditions in the higher elevations. Being that we&rsquo;re all from California, the mud was nothing short of a challenge, and I followed behind my dad during the final 20 miles before lunch. Every time we stopped to regroup, he kept asking if I wanted to pass, but I never did. Instead I decided to keep a safe distance back in order to watch what lines he took or where the rocks were to miss. Basically, if he got loose&mdash;and he definitely did a few times&mdash;I knew not to take that line. Sorry Dad, but just like when I was on my 80, you were the trail guinea pig. After miles of sloppy mud, we made it to lunch with huge smiles on our muddy faces, thankful to get a break and a chance to bull shit with everyone else.</p>\r\n<p>Arguably the coolest aspect of the ride is the camaraderie, which is very apparent at the lunch stop during the second day. Out in the middle of nowhere, the BITD crew organized a fully catered lunch, and before you even eat, you grab a hot towel to clean up with and play a hand of electronic poker, which the winner is announced at the wrap-up dinner later that night. Everyone sat at the tables, ate homemade pulled-pork sandwiches, and bench raced about the first half of the day. And once our stomachs were full, causing a few guys some unpleasant heartburn for the last section, we jumped on our bikes for the final 20 miles back to town.</p>\r\n<p>That night, the annual Easter Egg Run was held right before dinner followed by the hilariously entertaining Whistle Dick awards. If you&rsquo;ve ever been to a Best In The Desert event, you&rsquo;ve likely heard BITD founder Casey Folks lovingly&mdash;or not so lovingly&mdash;refer to people who make dumb decisions as &ldquo;whistle dicks&rdquo;. This year, in keeping with Casey&rsquo;s fun-loving award ceremony, his son Darryl and Scott Harden did the honors on Casey&rsquo;s behalf, awarding various riders with a small pink whistle dick for their actions over the past couple days. Each award was just as funny as the previous, and everyone drank beer, laughed, and had a good time the only way Casey would have wanted it&mdash;a bunch of motorcycle riders making fun of each other.</p>\r\n<p>When I sit back and think about where I&rsquo;ve been because of motorcycles, none of it has been as cool as the times I&rsquo;ve spent with my dad&mdash;either chasing him or him chasing me. Since I first started riding, he has been by my side through it all and even though neither of us are as quick as we used to be, or get to ride together as often as we used to, twisting the throttle, throwing mud, and laughing still is at the top of my list of things I love to do with my dad. Getting the opportunity to participate in the Nevada Trail ride was rad, and as long as my dad or I can lift our legs over the top of a dirt bike, we&rsquo;ll be attending. Until next time&mdash;as Casey would say&mdash;booyah!!!</p>\r\n<p><em>By Brendan Lutes</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 33, type: "DocumentPart::HtmlContent", title: "", content: "<p>In this the third episode of After Hours With Sean Collier, Sean sits down with motocross legend Ricky Johnson to talk about his MX career, truck racing, life, and more. Grab a drink, kick up your feet, and enjoy stories from RJ that you've likely never heard before.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 34, type: "DocumentPart::HtmlContent", title: "", content: "<p>The highly anticipated release of The Viewing's film of their trip last year to the infamous Zwartecross in Holland is one that has proved to be well worth the wait. Packed full of good times, racing, crazy Euro fans, and epic memories make this video one you don't want to miss. Back when the trip went down late last year, we posted a few blogs from the crew. After you watch the video, click the links below to check out the play-by-play on the trip.</p>\r\n<p><a href=\"http://www.thefasthouse.com/the-scene/articles/the-viewing-packin-black-road-report-number-one\" target=\"_blank\">Road Trip Blog 1</a></p>\r\n<p><a href=\"http://www.thefasthouse.com/the-scene/articles/the-viewing-dicke-titten-kartoffelsalat-road-report-number-two\" target=\"_blank\">Road Trip Blog 2</a></p>\r\n<p><a href=\"http://www.thefasthouse.com/the-scene/articles/the-viewing-welcome-to-amsterdayle-road-report-number-three\" target=\"_blank\">Road Trip Blog 3</a></p>\r\n<p></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 35, type: "DocumentPart::HtmlContent", title: "", content: "<p>The Viewing is at it again, but this time they take a tour around the iconic Castillo Ranch during the Racer X Ride Day last week. Insane whips, picturesque vistas, and the infamous McGrath jump from Terrafima 2 highlight this rad video.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 36, type: "DocumentPart::HtmlContent", title: "", content: "<p>Off-road racing is gnarly. Not only is it a battle against other racers, but it's also a battle of attrition against the elements. Of all the races on the West Coast, it could be argued that the Lake Havasu WORCS event is one of the most brutal and unforgiving races on the calendar. The temperatures often hover around the 100-degree mark, the sun is blistering, and the fact that it lasts two hours makes it a race where only the fittest racers survive&mdash;let alone come out on top.</p>\r\n<p>This past weekend, Blayne Thompson was finally able to shake the proverbial monkey off his back&mdash;bad luck has plagued him since his decisive victory at Adelanto in January&mdash;to take the win at Havasu over a stacked field of off-road racers. Around a course littered with rocks, deep sand whoops, and a blitz down the beach in front of young Spring Breakers, Blayne outlasted a hard-charging Gary Sutherlin and defending Champion Robby Bell.</p>\r\n<p><strong>RESULTS:</strong><br /><br />1. Blayne Thompson (Hon)</p>\r\n<p>2. Gary Sutherlin (Yam)</p>\r\n<p>3. Robby Bell (Kaw)</p>\r\n<p><em>Photos by Tanner Yeager</em></p>\r\n<p></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 37, type: "DocumentPart::HtmlContent", title: "", content: "<p>The Viewing has been up to some rad stuff lately, and most recently visited Jimmy Hill at his property near Bakersfield, California, for some good times on the jumps, hips, and various fun boxes. Hill has become known as a killer soul rider who's talent never ceases to amaze us, and when paired with Durham's effortless style, this video is one for the ages.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 38, type: "DocumentPart::HtmlContent", title: "", content: "<p>This past weekend was one for the books, as we decided to head out to the AMA District 37 Big Six race at Glen Helen Raceway for some good times on two wheels and fun with friends. The Big 6 Series is what dirt bikes have and always will be about&mdash;going fast, taking chances, and bull shitting about it with buddies back in the pits. For the entire story from the weekend, <a href=\"http://www.thefasthouse.com/stories/just-like-old-times\" target=\"_blank\">CLICK HERE</a> to check out the rad Fasthouse Photo Story.</p>\r\n<p><a href=\"http://www.thefasthouse.com/stories/just-like-old-times\" target=\"_blank\"><strong>FASTHOUSE PHOTO STORY</strong></a></p>\r\n<p><em>Photos by Max Mandell</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 39, type: "DocumentPart::HtmlContent", title: "", content: "<p>For the second episode of After Hours With Sean Collier, we dig deep into the life and career of former professional motocross racer Mike Healey. From his success as a young pro to nearly winning a World Motocross Championship to his dark days and emerging as a completely new person, better and ready for whatever gets thrown his way. Healey has lived a full life, yet he's just getting started on the newest chapter.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 40, type: "DocumentPart::HtmlContent", title: "", content: "<p>Here at Fasthouse, we've always supported the arts. And when we met Meghan from Wild Wanderer, we knew a collaboration was in the future. After a few meetings, she produced an impressive line of handmade wallets, key chains, and purse. All of which exemplify the lifestyle and feel of when rules were few and life was simple. Completely handmade in LA County from high quality leather, each item is dedicated to the drifters of the world&mdash;the ones that wander where ever the wind may blow them, and where ever the good times take them. <a href=\"https://store.thefasthouse.com/collections/leather-goods\">CLICK HERE</a> to check out the full collection.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 41, type: "DocumentPart::HtmlContent", title: "", content: "<p>Here at Fasthouse, we're constantly striving to bring you the raddest content possible, so that when you visit our website, it's not just to pick up some new gear or partyware, but to check out what we have going on. With this in mind, we're launching a brand new web series titled \"After Hours With Sean Collier\". Sean is no slouch on a dirt bike and his on-camera personality is rad, making him an easy choice to host. Each episode will feature a new guest, ranging from motocross riders, artists, athletes, or anyone interesting. The aim of the show is to dig deeper into the lives of these individuals in a way that hasn't been done before. In true Fasthouse style, though, the vibe of the show is laid back, fun, and all about hanging out.</p>\r\n<p>For our first installment, we brought current Fasthouse rider, and successful professional motocross racer, Darryn Durham into our studio. In this interview, he goes in-depth into what it was like for him as a racer, riding for some of the sport's most elite teams before ultimately begining his own racing team last year. Check back in later weeks, as we have some big name guests lined up to chat with Mr. Collier.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 42, type: "DocumentPart::HtmlContent", title: "", content: "<p>In the world of Hollywood stunts and big budget action movies, Fasthouse crew member, and all around badass, Mic Rodger&rsquo;s name is at the top of the list. In a career that spans over 30 years, Mic has worked on some of the biggest movies in cinema history, including &ldquo;Braveheart&rdquo; where he doubled for actor Mel Gibson and served as 2<sup>nd</sup> Unit Director and Stunt Coordinator. Since then, he&rsquo;s worked on too many feature films to list, but most recently was the 2<sup>nd</sup> Unit Director for the critically acclaimed film Hacksaw Ridge.</p>\r\n<p>The film is based on the true story of American Army medic Desmond Doss. He was the first Conscientious Objector to be awarded the Medal of Honor in the Second World War for saving over 75 soldiers without picking up a gun. The film&rsquo;s action sequences were shot entirely in Australia with Mic directing the 2<sup>nd</sup> Unit where much of the major action gags were performed. So far him and his crew have been awarded a SAG Award for Outstanding Performance by a Stunt Ensemble in a Motion Picture. Currently the film is nominated for six Academy Awards, including Best Picture, Best Director, and Best Actor.</p>\r\n<p>When Mic isn&rsquo;t busy on set, he can be found at the local motocross tracks and Saturday REM races at Glen Helen, twisting the throttle with his buddies.</p>\r\n<p><strong>HACKSAW RIDGE</strong></p>\r\n<p><strong>Director:</strong> Mel Gibson</p>\r\n<p><strong>Staring:</strong> Andrew Garfield, Teresa Palmer, Vince Vaughn, Luke Bracey, and Sam Worhtington</p>\r\n<p><strong>Release Date:</strong> November 2, 2016</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 43, type: "DocumentPart::HtmlContent", title: "", content: "<p>With all the recent torrential rain storms, Willy Simons Jr. has been burning his training laps, while still having fun, at a secret sand track in the high desert. Comprised of waist deep whoops, long straights, and loamy berms, the track is any dirt bike rider's dream. We decided to tag along for a day of riding, and watched as \"Lil' Will\" wrung the neck of his dad's old Yamaha YZ250.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 44, type: "DocumentPart::HtmlContent", title: "", content: "<p>Here at Fasthouse, we've always been more about good times on two wheels rather than the racing side of it. \"We race... sometimes\" has become one of our unofficial slogans and a way of conveying what the FH brand is all about&mdash;the love of the sport and good times with close friends and family. When you're of age, there really is nothing better than an ice cold 805 Beer after a day of motoing with your buddies. And with that in mind, we recently made a trip to one of our favorite tracks, Zaca Station, in 805's neck of the woods to spin some laps, bullshit with buddies, and toss back a few cold ones at the end of the day. Gas and beer&mdash;the Fasthouse way.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 45, type: "DocumentPart::HtmlContent", title: "", content: "<p>For the second year in a row, the Fasthouse crew made the trek up to the high desert for the District 37 Adelanto Grand Prix hosted by SoCal MC. After dominating the pro race last year, Blayne Thompson came into the event ready to defend his King of Adelanto title. Unfortunately, after taking over the lead and opening up a sizeable gap over the field, Saturday's pro race was red flagged due to an injured rider. With the sun quickly dropping, the officials made the decision to restart the race first thing Sunday morning. Even with the restart, though, Blayne managed to hold off challenges from the competition to once again take home the Adelanto crown and lion's share of the huge pro purse. Behind him, Willy Simons Jr. rode his ass off aboard his trusty YZ250 two-stroke to take home the win in the Pro 2 Class. With a ton of rad shots to share, we decided to put together a Fasthouse Story photo feature. <a href=\"http://thefasthouse.com/stories/fifth-gear-tapped\" target=\"_blank\">CLICK HERE</a> to check it out.</p>\r\n<p><strong>RESULTS:</strong></p>\r\n<p><strong>Pro:</strong></p>\r\n<p>1. Blayne Thompson (Hon)</p>\r\n<p>2. Trevor Stewart (Hon)</p>\r\n<p>3. Gary Sutherlin (Yam)</p>\r\n<p><strong>Pro 2:</strong></p>\r\n<p>1. Wily Simons Jr. (Yam)</p>\r\n<p>2. Mitch Anderson (KTM)</p>\r\n<p>3. Clay Hengeveld (Kaw)</p>\r\n<p><a href=\"http://thefasthouse.com/stories/fifth-gear-tapped\" target=\"_blank\">FASTHOUSE ADELANTO STORY</a></p>\r\n<p><em>Photos and Words by Brendan Lutes</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 46, type: "DocumentPart::HtmlContent", title: "", content: "<p>Southern California&rsquo;s Robbie Wageman comes from a motocross family. Since the age of three he&rsquo;s been on two wheels, riding and racing alongside his older brother, RJ, under the guidance of their dad. After completing the Arenacross series last year, Robbie earned his professional license and the opportunity to live out his dream of racing Supercross in 2017.</p>\r\n<p>After months of preparation, the 17-year-old entered Anaheim stadium for the first time last weekend, lined up against his heroes, and turned some heads with his speed and tenacity.</p>\r\n<p><strong>NAME:</strong> Robbie Wageman</p>\r\n<p><strong>HOMETOWN:</strong> Santa Clarita, California</p>\r\n<p><strong>AGE:</strong> 17</p>\r\n<p><strong>YEARS RIDING:</strong> 14</p>\r\n<p><strong>What were your thoughts going into your first professional Supercross race?</strong></p>\r\n<p>Going into my first pro race, I was definitely really excited. My first goal was to obviously make it to the night show, which I did. My second goal was to complete all the laps that I could, and if I made the main, that would be great. But I just wanted to complete as many laps as I could. I&rsquo;m just focused on making improvements for next weekend and continue getting better.</p>\r\n<p><strong>What was the biggest surprise of the weekend?</strong></p>\r\n<p>There really weren&rsquo;t any big surprises. I knew that if I got myself up there with the top guys, I could run their pace. I just have to get a good start.</p>\r\n<p><strong>Was it a surreal feeling to walk into the stadium for the first time?</strong></p>\r\n<p>It was definitely a surreal moment when I first walked into the stadium for track walk. I was stoked. It was awesome, because there&rsquo;s just no better feeling than doing that. I&rsquo;ve done Monster Cup for the past five years, but there&rsquo;s nothing like racing Supercross in Anaheim&mdash;there&rsquo;s nothing like it. Monster Cup is a cool learning experience, and it gets you prepared for all the people in the stadium, but racing actual Supercross in Anaheim is a different feeling&mdash;in a better way. It&rsquo;s awesome.</p>\r\n<p><strong>What are some of the goals that you&rsquo;ve set for yourself?</strong></p>\r\n<p>For me to just progress every weekend; I want to make the main consistently; and get myself up there with those top guys to see what I can do.</p>\r\n<p><strong>Being 17 is pretty young to turn pro, right?</strong></p>\r\n<p>Yeah, it&rsquo;s a young age and everyone always asks me that. At this point, I feel really comfortable in Supercross, and I had more to gain than lose if I stayed in amateurs for another year.</p>\r\n<p><strong>Any crazy things happen to you during the weekend? Any fans ask you to sign anything weird?</strong></p>\r\n<p>Hopefully if I make it in the main I&rsquo;ll get to sign some cool stuff (laughs), but there were a few people that came over. It was a cool experience to get to sign some autographs&mdash;some young kids and older people that didn&rsquo;t really know anything about motocross. That was really cool. I had a decent get-off in practice, which didn&rsquo;t really set me back, but it was scary. I went over the bars and had to regroup from that one. Other than that, I had a great experience racing my first Supercross. I&rsquo;m looking forward to San Diego.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 47, type: "DocumentPart::HtmlContent", title: "", content: "<p>This winter has been particularly awesome if you're a dirt bike rider in Southern California. Rain has come almost every week since November, leaving the local riding spot prime for some fun. Fasthouse soul rider Ricky Diaz recently loaded up his truck and headed out for an afternoon of fun with Max Mandell along to document it all. Big air, perfectly sculpted lips, and wet dirt add up to one hell of a good time.</p>\r\n<p><em>Photographer: Max Mandell</em></p>\r\n<p><em>Location: SoCal Hills</em></p>\r\n<p><em>Rider: Ricky Diaz</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 48, type: "DocumentPart::HtmlContent", title: "", content: "<p>This past year was a huge one for Fasthouse. What humbly started inside a garage has quickly blossomed into a company that people are beginning to associate with what we&rsquo;ve always been about&mdash;speed, style, and good times. We still get the question, &ldquo;What is Fasthouse?&rdquo; But to be completely honest, we like it that way. Remaining enigmatical and ambiguous is what keeps us different from the norm, and it&rsquo;s what motivates us to continue producing rad content, gear, and good times for the unforeseeable future.</p>\r\n<p>When we look back on 2016, it&rsquo;s hard to nail down our favorite moments&mdash;our gear was released, Durham and Bereman toured the East Coast, we left an indelible mark on Mammoth Mountain, and Collier continued to rip aboard The Beast. This past year has produced way too many memories to even list, and to break it down a little, we&rsquo;ve chosen a few of our favorite videos and photos, chronicling the crazy year. Before &rsquo;16 wraps up, enjoy looking back at some of our unforgettable times, but more importantly, while you relive this past year, remember that it&rsquo;s about living in the now, spending time with friends and family, and being thankful. Here&rsquo;s to a happy and healthy New Year.</p>\r\n<p><strong>2016</strong> <strong>VIDEOS:</strong></p>\r\n<p><a href=\"http://www.thefasthouse.com/the-scene/articles/two-strokes-are-cool-burning-premix-with-trevor-stewart-sean-collier\" target=\"_blank\">&ldquo;Two-Strokes Are Cool&rdquo;</a></p>\r\n<p>Who doesn&rsquo;t like the smell of premix in the morning? Riding and racing two-strokes is something that is near and dear to our hearts&mdash;the trusty machines are what the sport was built upon. And for the past few years, Sean Collier has been ripping his KX500 while Trevor Stewart has also been racing&mdash;and winning&mdash;aboard his tried and true YZ250. We spent a weekend with the duo, following each of them as they lined up aboard their premix-burning machines against the modern four-strokes.</p>\r\n<p><a href=\"http://www.thefasthouse.com/the-scene/articles/east-coast-is-toast-darryn-durham-and-tyler-bereman\" target=\"_blank\">&ldquo;East Coast Is Toast&rdquo;</a></p>\r\n<p><em>This video was our way of telling the world what Darryn Durham and Tyler Bereman were about to get themselves into with their East Coast Supercross tour. We weren&rsquo;t totally sure what to expect going into the season with two of the most outspoken and charismatic racers, but it turned out to be one of the most unforgettable video series of the year.</em></p>\r\n<p><a href=\"http://www.thefasthouse.com/the-scene/articles/high-speed-in-the-high-desert-adelanto-grand-prix\" target=\"_blank\">&ldquo;High Speed In The High Desert&rdquo;</a></p>\r\n<p><em>It takes a special breed of racer to go fast in the desert. Not only does it require a truckload of talent, but also massive balls to be able to hold a modern 450 wide open across the vast unknown. Early in 2016, we tagged along with off-road racers Blayne Thompson and Trevor Stewart as they competed in the infamous Adelanto Grand Prix, which Blayne proceeded to win in dominating fashion.</em></p>\r\n<p><a href=\"http://www.thefasthouse.com/the-scene/articles/2016-mammoth-motocross-video\" target=\"_blank\">&ldquo;2016 Mammoth Motocross&rdquo;</a></p>\r\n<p><em>As the longest running motocross race in the U.S., the annual Mammoth Motocross is a must on our list of yearly events, and this year&rsquo;s race was one we&rsquo;ll never forget. Most importantly, the race served as our brand new gear debut, but between Bereman and Collier switching riders mid-race, the excellent bowling party, and Wacker&rsquo;s now infamous 30-second-board burnout, the Fasthouse crew left an unforgettable mark on the event. Here&rsquo;s hoping we&rsquo;re invited back for the 50<sup>th</sup> running of the race in 2017.</em></p>\r\n<p><a href=\"http://www.thefasthouse.com/the-scene/articles/raising-some-hell-durham-and-crew-hit-the-pnw\" target=\"_blank\">&ldquo;Raising Some Hell | Durham And Crew Hit The PNW&rdquo;</a></p>\r\n<p><em>What began as a simple bike build with Tony Jeske of Jeske MX Customs quickly turned into an adventure that spanned the course of 2016. The YZ125 dubbed &ldquo;Hell Raiser&rdquo; debuted at The 1 Moto Show back in February, sat idle for the summer, and was raced by Darryn Durham at the 125 Dream Race in September. The weeklong trip to the Pacific Northwest was one none of us will soon forget, especially after poaching downtown Portland aboard the bike.</em></p>\r\n<p><a href=\"http://www.thefasthouse.com/the-scene/articles/renaissance-man-brian-bent-s-punk-rock-fasthouse-collab\" target=\"_blank\">&ldquo;Renaissance Man | Brian Bent&rsquo;s Punk Rock Fasthouse Collab&rdquo;</a></p>\r\n<p><em>Artist, musician, skateboarder, surfer, Hot Rod builder, Pastor&hellip; Brian Bent is probably one of the radest people we&rsquo;ve ever met. When you meet him, his love for life is instantly palpable, and his passion for the arts is even more apparent. As an Orange County local, when he isn&rsquo;t painting, Bent spends most of his spare time either behind the wheel of a fast car or with his feet firmly planted on a board of some kind. After admiring his artwork, we decided to hook up with him and have him design a rad limited edition jersey, which will be available in early 2017.</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 49, type: "DocumentPart::HtmlContent", title: "", content: "<p>The holiday season is well upon us, and this past weekend, the crew at Fasthouse threw a rad get together&nbsp;at the FH Headquarters for family and friends. Cold drinks were consumed, good times were had, and memories were made. Here's to a Merry Christmas to you and yours. Check the photos to see what went down.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 50, type: "DocumentPart::HtmlContent", title: "", content: "<p>Incase you haven't seen the rad Von Zipper/Fasthouse goggles and sunglasses, here's your wake up call. The brand new eyewear was first introduced about a month ago, and since then, it's been a huge hit. As a way of launching the collaboration, the VZ boys put together this killer video from this year's 19th annual Red Bull Day In The Dirt. Check out the video then click the link below to learn some more about the goggles and sunnies. Three goggles styles and two types of glasses make it easy to find one you like.</p>\r\n<p><a href=\"https://store.thefasthouse.com/collections/goggles-shades\">Von Zipper Eyewear</a></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 51, type: "DocumentPart::HtmlContent", title: "", content: "<p>It's now been one week since the mayhem and good times of this year's 19th annual Red Bull Day In The Dirt. And if you've been going through withdrawls since, we have just the cure for that. Check out the rad video from our friends at Motosport Outlet. The links below will also take you to coverage from the various magazines and websites.</p>\r\n<p><a href=\"http://www.vitalmx.com/photos/features/Day-In-The-Dirt-Photo-Gallery,38994/A-Day-In-The-Dirt-Photo-Gallery,96507/GuyB,64\" target=\"_blank\">Vital MX</a></p>\r\n<p><a href=\"http://motocross.transworld.net/photos/day-dirt-19-weekend-snapshots/#As8m1DTbHjooga1r.97\" target=\"_blank\">TransWorld Motocross</a></p>\r\n<p><a href=\"http://motocrossactionmag.com/news/kyoshi-beckers-day-in-the-dirt-photo-gallery\" target=\"_blank\">Motocross Action</a></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 52, type: "DocumentPart::HtmlContent", title: "", content: "<p>This year's 19th running of the Red Bull Day In The Dirt was one that no one will soon forget. Good times, close racing, mud, and bench racing around the camp fire&mdash;with cold ones in hand of course&mdash;all added up to one hell of an amazing time. We did some racing ourselves, but between that, we were sure to document just about everything that went down. Click the link below to check out our brand new photo feature, Fasthouse Stories.</p>\r\n<p><a href=\"http://thefasthouse.com/stories/red-bull-day-in-the-dirt-19\" target=\"_blank\">Red Bull Day In The Dirt 19 Story</a></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 53, type: "DocumentPart::HtmlContent", title: "", content: "<p>We tagged along with Trevor Stewart and Sean Collier as they competed aboard their two-strokes at the Gorman Big 6 Grand Prix and Vet World Championships. Find out why they choose to ride two-strokes and what they love about two wheels.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 54, type: "DocumentPart::HtmlContent", title: "", content: "<p>Each year, Red Bull Day In The Dirt offers a plethora of unique events with classes for just about any rider or bike. And for the past few years, DITD has partnered with Meatball from <strong>Hell On Wheels</strong> to host a rad backyard-style vintage race on <strong>Saturday night</strong>. This year, though, in addition to Meatball's race, DITD will play host to <strong>Roland Sands' Super Hooligan</strong> event, featuring riders navigating a dirt track on heavy twins with no front brakes. As if that wasn't enough, the Hooligan race will be held under the lights, circling a huge bonfire. We predict a high chance of Sketchiness with a side of really good times. For more information on each event, check out the links below. Even if you don't have a bike to ride in either of these, come out and enjoy a cold one from 805 Beer.</p>\r\n<p><a href=\"http://hellonwheelsmc.com/\" target=\"_blank\">Hell On Wheels Entry</a></p>\r\n<p><a href=\"http://www.rolandsands.com/\" target=\"_blank\">Roland Sands Design</a></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 55, type: "DocumentPart::HtmlContent", title: "", content: "<p>Our friends at Dust Rider in Paris, France, recently celebrated their grand opening in style. In addition to just about anything mx related, you can find plenty of Fasthouse gear and clothing at the new store, which is located in the heart of Paris. Check out this rad little video to see the good times.</p>\r\n<p><a href=\"http://www.dust-rider.com\"><img src=\"https://cdn.shopify.com/s/files/1/0259/6401/files/logo-dustrider.png?8660148667747878927\" border=\"0\" target=\"_blank\" /></a></p>\r\n<p>Visit their site at: <a href=\"http://www.dust-rider.com\" target=\"_blank\">dust-rider.com</a></p>\r\n<p></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 56, type: "DocumentPart::HtmlContent", title: "", content: "<p>Every year of the annual Red Bull Day In The Dirt is special. It's filled with family time, seat time, and good times. Every year, we commemorate the event with some rad gear and this year's helmet, jersey, and pants are some of the coolest yet. The helmet was designed by Fasthouse and produced by Bell Helmets. It comes in one of their revolutionary Moto-9 Flex helmets, which features cutting edge helmet safety technology. The jersey is based off our proven jersey design and the pants are cut from our Grindhouse pattern. The pants also have an interchangeable patch on the back, going from DITD to M/C. All the gear will be available to purchase at the event, and available year round, but if you want to be looking good prior to rolling out to DITD, be sure to get a hold of your set in our online store, starting this week.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 57, type: "DocumentPart::HtmlContent", title: "", content: "<p>Artist, musician, skateboarder, surfer, Hot Rod builder, Pastor&hellip; Brian Bent is probably one of the raddest people we&rsquo;ve ever met. When you meet him, his love for life is instantly palpable, and his passion for the arts is even more apparent. As an Orange County local, when he isn&rsquo;t painting, Bent spends most of his spare time either behind the wheel of a fast car or with his feet firmly planted on a board of some kind. When we met him at last year&rsquo;s Red Bull Day in the Dirt where The Bent Duo played&mdash;a band comprised of Brian and his daughter&mdash;we knew we had to collaborate with him on something. Bent&rsquo;s style is second to none and his artistic design dates back over 20 years to when he created much of the style that Southern California surf brand Becker was known for. With a beautiful California day on our hands, we met up with him at his house where he keeps his six cars and had him create a soon-to-be-released limited edition Bent Fasthouse jersey.</p>\r\n<p><em>Video &ndash; Brendan Lutes</em></p>\r\n<p><em>Additional Camera &ndash; Jordan Powell</em></p>\r\n<p><em>Stills &ndash; Brendan Lutes</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 58, type: "DocumentPart::HtmlContent", title: "", content: "<p>Sure, there&rsquo;s some racing going on at Red Bull Day In The Dirt, but what everyone&rsquo;s really there for is the good time, atmosphere, and well&hellip; ice cold 805 Beer. In years past, Friday night has always been relatively quiet. It&rsquo;s the evening where the &ldquo;serious&rdquo; racers take it easy, rest up, and prepare for their races on Saturday morning. But this year we&rsquo;ve thrown a wrench into those plans, because let&rsquo;s be honest, who&rsquo;s actually at DITD to be serious about their racing?</p>\r\n<p>This year, Friday night will feature&mdash;for the first time ever&mdash;the 805 Beer Drag Races where anything goes. As long as you have a bike with two wheels, a motor, and a throttle you can enter the drag race. And in true run-what-ya-brung fashion, the weirder and more &ldquo;out there&rdquo; the bike, the better. Entries will be collected the day of and scratched down on a napkin. After which you&rsquo;ll be randomly pitted against your opponent, loaded into the starting house, and blasting down the strip before you know it. All we&rsquo;re saying is, don&rsquo;t wear yourself out in Happy Hour Practice or the SoCal Reunion race, because you&rsquo;ll need to be able to twist the throttle for this true backyard racing session, which has a better than not chance of materializing into full blown sketchiness.</p>\r\n<p><b>WARNING</b> Reaction times might be a little slower than normal, and things might escalate quickly. We&rsquo;re just sayin&rsquo;&hellip;</p>\r\n<p>For more info: <a href=\"http://www.dayinthedirt.com\" title=\"Day in the Dirt\" target=\"_blank\">www.dayinthedirt.com</a></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 59, type: "DocumentPart::HtmlContent", title: "", content: "<p>The annual pilgrimage to Glen Helen Raceway that is known as Red Bull Day In The Dirt has become a tradition for numerous racers and their families. In addition to the fun atmosphere, each day features unique races that keep the low-key vibe rolling throughout the three days. Events that range from team races to vintage events to the popular FMF Two-Stroke Revival race on Saturday morning mix up the schedule to keep things interesting. The two-stroke event, though, not only allows racers another chance to spin some laps, but it gives them the opportunity to pull out their trusty two-stroke machines and do battle against other premix aficianados. Last year, the race was one of the most popular of the long weekend, drawing 150 entries and producing some excellent battles. It also attracted some of the sport's top racers, as Red Bull KTM's Taylor Robert took the win ahead of Trevor Stewart and former racer turned Freestyle rider Jarryd McNeil.</p>\r\n<p>This year's Two-Stroke race is already filling up fast, so if you want to mix some gas and haul some ass, you better get your entry form in fast. We'll be highlighting some of the most memorable events over the course of the coming weeks. Stay tuned!</p>\r\n<p><a href=\"http://www.dayinthedirt.com/\" target=\"_blank\">CLICK HERE</a> to get your entry in for the event.</p>\r\n<p><em>Photos from TWMX, Vurb Moto, and Vital MX</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 60, type: "DocumentPart::HtmlContent", title: "", content: "<p>Last week, we tagged along with Darryn Durham as he traveled to the Pacific Northwest to race the annual 125 Dream Race at Washougal MX Park aboard Jeske MX Customs' YZ125. The \"Hell Raiser\", as the bike is lovingly referred to, was originally built by Tony Jeske for The 1 Moto Show, and plans for DD to race it were in the works all along. The trip, though, wasn't all about racing. As you would expect, the crew had some fun along the way, touring Portland, hitting up local water holes, and checking out the iconic motorcycle spots along the way. And to put a final exclaimation point on the trip, DD hit up downtown Portland on the last day for some wheelies and one big burnout. You can't name a bike Hell Raiser without raising a little hell on it...</p>\r\n<p><em>Video and Photos by Brendan Lutes</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 61, type: "DocumentPart::HtmlContent", title: "", content: "<p>We're up in the Pacific Northwest for the 125 Dream Race this weekend at Washougal. And ever since seeing the Hell Raiser YZ125 built by Tony Jeske of Jeske MX Customs unveiled at <a target=\"_blank\" href=\"http://the1moto.com/\">The 1 Moto Show</a> earlier this year, we've had plans to get Darryn Durham aboard the machine. Yesterday at an undisclosed location just outside of Portland, Oregon, DD got to rip the Hell Raiser for the first time. To wet your appetite with a little two-stroke action, we threw together this quick on board video. Be sure to turn up the volume, and follow us on <a target=\"_blank\" href=\"https://www.instagram.com/fasthouse_/\">Instagram</a> to keep up with everything we have going on up here in the PNW.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 62, type: "DocumentPart::HtmlContent", title: "", content: "<p>It&rsquo;s been over 10 years since I&rsquo;ve attended a professional motocross race as a spectator behind the fence line and in the beer line. I&rsquo;ve been traveling the world as a motocross photographer and magazine editor for my entire post-college adult life. Don&rsquo;t get me wrong, it&rsquo;s been great&mdash;I&rsquo;ve seen and done more things than most people get to do in a lifetime. I&rsquo;ve tested factory bikes, gone for a ride in Chad Reed&rsquo;s rally car, ridden the Motocross of Nations track&mdash;in France&mdash;the day after Dungey and Villopoto clinched the championship, visited some of the most iconic tracks around the world, gotten to know many of the sports greatest riders&hellip; that&rsquo;s just the tip of the proverbial iceberg. But what I haven&rsquo;t done is enjoy a foot-long hot dog and ice-cold beer while dodging roost and hanging over the trackside fence at a National or Grand Prix.</p>\r\n<p>With the Glen Helen USGP slated for this past weekend, and no real reason for me to trudge around all day, snapping endless photos, I decided it was the perfect opportunity to experience motocross the way it should be. Like a true spectator, I didn&rsquo;t even have access to the pits&mdash;just a regular general admission wristband, because lets be honest, pit passes are expensive. I still slung my trusty camera over my shoulder, though, only this time I put on one short lens&mdash;no 300mm 2.8 or quiver of various lenses weighing me down&mdash;just my camera in one hand and a frothy beer in the other. What I found was that I still love this sport of motocross just as much as my 12-year-old self, and that&rsquo;s a good thing.</p>\r\n<p>I&rsquo;ve become a little jaded by all the glitz and glamour of the professional racing scene; all the long nights of writing race reports and editing photos have worn me down and diminished my enthusiasm for watching dirt bikes. But getting to be a fan again showed me the energy and excitement that&rsquo;s in the crowd, and that standing in the heat and dust all day is actually quite fun. It reminded me what the sport of motocross is all about&mdash;battling the elements, conquering fears, overcoming hardships, but most of all, fun.</p>\r\n<p>In the second moto, as Eli Tomac made his way to the front from a horrible start, the crowd erupted every time he went by&mdash;beer spilling, roost flying, and air horns blasting. It was truly cool soaking it all in, wandering around with my wife and buddies, as we looked for the next gnarly spot to watch the riders navigate. Standing back and observing from a perspective that I&rsquo;m not used to provided a new perspective on everything. I did get into the pits for a brief second, though, thanks to a buddy (whom shall remain nameless) who loaned me his wristband. Racing is badass, and I&rsquo;m going to be reliving this day where I didn&rsquo;t bother getting the all access photo pass, but instead roamed around the track, snapping photos that told the story of my day and the fun we all had at the races. We didn&rsquo;t necessarily care too much about missing great passes or insane battles. The day was all about watching some of the world&rsquo;s best riders tackle one of the world&rsquo;s toughest tracks.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>RESULTS:</strong></p>\r\n<p><strong>MXGP</strong></p>\r\n<p>1. Eli Tomac (Kaw)</p>\r\n<p>2. Antonio Cairoli (KTM)</p>\r\n<p>3. Tim Gajser (Hon)</p>\r\n<p>4. Max Nagl (Hus)</p>\r\n<p>5. Gautier Paulin (Hon)</p>\r\n<p>&nbsp;</p>\r\n<p><strong>MX2</strong></p>\r\n<p>1. Jeffrey Herlings (KTM)</p>\r\n<p>2. Jeremy Martin (Hon)</p>\r\n<p>3. Mitchell Harrison (Yam)</p>\r\n<p>4. Max Anstie (Hus)</p>\r\n<p>5. Keremy Seewer (Suz)</p>\r\n<p>&nbsp;</p>\r\n<p><em>Photos and Words by Brendan Lutes</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 63, type: "DocumentPart::HtmlContent", title: "", content: "<p>In spite of a couple crashes that kept my seat time to a minimum this year, I&rsquo;ve been riding a lot over the past few weeks, and I&rsquo;m feelin&rsquo; good. &ldquo;We race&hellip; sometimes.&rdquo; A joking moniker that became a serious reality of 2016, thanks in part to those crashes, has somehow become the theme of 2016 for me. We've been hard at work riding, racing sometimes, and filming all of it for an upcoming four-part series dubbed, \"We Race, Sometimes.\" It's action-packed with freeriding, fun, and \"sometimes\" racing. Be on the look out for the first video to drop in the coming weeks. For now, I just wanted to get you caught up on what&rsquo;s been going on.</p>\r\n<p>I've had a loose, yet serious, outlook on racing since I was a kid&mdash;I always have fun with it. When I was younger, my brother was the fast one, and I was the goof off who was doing tricks and chasing chicks. But even after all these years, when I really think about it, I'm starting to realize that I'm still exactly the same. After 25 years of racing, earning a lifetime AMA membership, and having more good times than I can remember, this party is just getting started! Over the past few weeks, I&rsquo;ve been back home&mdash;<a target=\"_blank\" href=\"http://www.thefasthouse.com/the-scene/articles/home-sweet-home-durham-returns-to-pa\">which I wrote about last week</a>&mdash;enjoying some family time and a little racing.</p>\r\n<p>This past Saturday, we went riding at Rick Kresic's track out by the Pittsburgh Airport. While we were there, a friend mentioned a money race at Briarcliff in Ohio. It sounded like a good idea, so I went home, prepped the bikes, and left at 4:00 AM the next morning to make it in time for the two-lap practice sessions. Luckily the races were long, as I had to learn the track on the fly since it was my first time there. It was a great layout with some of the best dirt I have ridden anywhere in the country. I was able to win all four motos, and our cameraman Mike even hit the track for the 125cc Legends race, and promptly faded like a black T-shirt out there!</p>\r\n<p>The next morning, I went on an epic mountain bike ride with my brother Shane. I figured out quickly, though, that he wanted to kick my ass, as he turned up the heat on the trails at North Park. If that wasn't enough to be sore, the next day I jumped on the road bike with Broc Hepler to tag along as he preps for the International Six Day Enduro next month. After all that, I have to be getting in shape. More importantly, though, all that training earned a couple cold ones with Mike. Just as the brews cracked, and we began to relax at Mike&rsquo;s house, his Mom said she had free Kennywood tickets&mdash;one of the oldest amusement parks in America. Without hesitation, we pounded our drinks and headed out the door for Kennywood.</p>\r\n<p>Opening in 1899, my favorite rides are the old wooden coasters built almost 100 years ago. The Jack Rabbit was built in 1920 and has a double dip where I swear the coaster gets some hang time. Another ride dubbed The Racer was built in 1927 and has two coasters racing side-by-side all the way to the finish. The craziest part, though, is that if you start on the left side, you end on the right, meaning somehow the train switches sides&mdash;I still haven't figured it out. It was a weekday, so the lines were short and we had a blast. If you're ever in Pittsburgh and someone hollers Kennywood's open! Check your zipper.</p>\r\n<p>I'm only home a few more days before I head back to race the 125 Dream Race aboard the Hell Raiser 125 built by Jeske MX Customs. The bike looks badass and I'm excited to line up for my first-ever 125 race! I might have to dust off the old Honda of Troy 125 for a few laps this week. We&rsquo;re headed up to the Pacific Northwest next Wednesday, and we&rsquo;ll be documenting the whole trip and posting updates along the way. Stay tuned!</p>\r\n<p><em>Photos by Mike LeGrand and Rupert Pellett</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 64, type: "DocumentPart::HtmlContent", title: "", content: "<p>If you haven&rsquo;t been to a Super Hooligan race&mdash;or better yet, participated in one&mdash;you&rsquo;re missing out. The bravado it takes to successfully navigate one of these heavy bikes around a slick dirt track is not only impressive to watch, but it&rsquo;s also thoroughly entertaining. During this year&rsquo;s annual motorcycle pilgrimage to Sturgis, Roland Sands and Indian helped to put on one of the coolest races at the rally.</p>\r\n<p>Held at the huge Buffalo Chip Campgrounds, the Super Hooligan race, which also featured a pro flat track class, drew a huge crowd of spectators and riders to witness racing on a track that was laid out on the concert grounds; right in front of the stage where Willy Nelson, Lynard Skynard, Elle King, Weird Al Yankovic, and more were slated to perform later in the evening. While not everyone at Fasthouse was lucky enough to attend, our friend Chris Sackett from Bell Helmets made the trek to try his hand at Hooligan racing aboard a RSD Yamaha Bolt. And Leticia Cline spun some laps decked out in her FH gear. All told, the race was a resounding success in spite of the rain that fell prior. Check out the accompanying photos and video from <a target=\"_blank\" href=\"http://www.rolandsands.com/blog/673/sturgis-moto-stampede\">Roland Sands Designs</a>. And who knows, you might just be seeing some Hooligans spinning laps on a specially designed track at this year&rsquo;s <a target=\"_blank\" href=\"http://www.dayinthedirt.com/\">Red Bull Day In The Dirt</a>. Stay tuned&hellip;</p>\r\n<p><em>Photos by Joe Hitzelberger and Preston Burroughs</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 65, type: "DocumentPart::HtmlContent", title: "", content: "<p>There&rsquo;s really nothing quite like getting back to our roots to race motorcycles with our buddies. And when Hell On Wheels decided to throw their Hot August Nights flat track race at Industry Hills Speedway this past weekend, we couldn&rsquo;t pass up the good time. What&rsquo;s better than strapping on a helmet, bringing just about any bike you want&mdash;including a smoke-belching three-wheeler if that's your thing&mdash;and throwing it sideways into the first corner? Aside from activities that are barely legal, there&rsquo;s not much that can top an evening of holding it wide, getting sketchy, and laughing every step of the way.</p>\r\n<p>After a brief rider&rsquo;s meeting, the evening started at around 6:00 with practice followed by heat races and main events. Hell On Wheels&rsquo; laid-back founder &ldquo;Meatball&rdquo; always puts on relaxed, fun events and this one was no exception. There was plenty of downtime to bullshit with buddies, check out the eclectic assortment of bikes, and partake in some cold ones if you weren&rsquo;t racing. On the track, the action was extremely entertaining&mdash;paint was traded, parts were bent, and egos were undoubtedly bruised after some of the crashes we witnessed. Our Fasthouse crew also made quite the impression over the course of the event, with a huge presence in the pits that included dirt bikes from just about every era and plenty of cold 805s in our ice chest.</p>\r\n<p>Decked out in the White Lightning jerseys&mdash;which have become an HoW tradition for us&mdash;the FH crew was either consistently up front or consistently having the most fun on the track. Tyler Bereman even raced with a cast on his left arm from a fresh break a few weeks ago, and in every race, he&rsquo;d somehow would &ldquo;not notice the checkered flag&rdquo; so he could sneak in a few extra laps. TB&rsquo;s dad Randy also made the drive from up north to race with his son, bringing out his immaculate Bultaco dirt track bike, aboard which he displayed some picture-perfect flat track style on his way to victory. He wasn&rsquo;t the only podium finisher in our group, though, as Brendan Lutes took the Vintage Class win, FH head honcho Kenny Alexander finished third in vintage, TB took the Mini Bike victory, Wacker finished second in Bomber, and Matt Cerami took second in the Modern Class. We definitely conquered the circle track, logging countless laps and dusting a case or two of 805s while smiling the entire time. Here&rsquo;s to the next time we get to have a good time at one of the Hell On Wheels&rsquo; events. Check out our huge photo gallery to see what you missed out on.</p>\r\n<p>If you weren&rsquo;t able to make it to the event, it was broadcast live on <a target=\"_blank\" href=\"http://livestream.com/expocenter/events/6243534\">Livestream.com/expocenter</a> and is currently archived on there to check out at any time.</p>\r\n<p><em>Photos by Max Mandell</em></p>\r\n<p><em>Words by Brendan Lutes</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 66, type: "DocumentPart::HtmlContent", title: "", content: "<p>Ever since Tony Jeske of Jeske MX Customs built a fully custom YZ125 for The 1 Moto show earlier this year, everyone was left wondering if it was built to rip or just built to be a piece of art. We&rsquo;re happy to report that along with Tony, we&rsquo;ve had big plans to race the beautiful machine dubbed Hell Raiser at the upcoming 125 Dream Race at Washougal MX Park in Washougal, Washington, on September 17<sup>th</sup>-18<sup>th</sup>.</p>\r\n<p>Since the beginning, Jeske has always wanted the bike to hit the dirt, and the plan has been to get a Fasthouse rider to compete aboard it. As luck would have it, with the Dream Race rapidly approaching, Darryn Durham&rsquo;s hectic schedule opened up, making him the easy choice as the rider lucky enough to put Hell Raiser&rsquo;s knobbies in the dirt. &ldquo;I&rsquo;m super excited to ride it,&rdquo; Durham said. &ldquo;The bike is a work of art, so I&rsquo;m excited to hit the dirt for the first time and tear it up.&rdquo; Surprisingly enough, even though Durham has a 125 of his own back home in Pennsylvania, he has never lined up behind a gate aboard it. &ldquo;I got a 125 about five or six years ago just for fun, and I love riding it. I think riding 125s makes you a better four-stroke rider. I&rsquo;ve put some time in on it, but I&rsquo;ve never really raced a 125 before, so this will be my first ever 125 race.&rdquo;</p>\r\n<p>As for the bike, Jeske built it almost on a whim. When invited to show a bike at the prestigious 1 Moto Show in Portland this year, Jeske didn&rsquo;t have a plan or a bike. But after procuring a YZ125 from local Portland dealership Power Motorsports, he decided to go all out, creating the Hell Raiser to drop jaws and get people talking about what a truly custom motorcycle is all about. &ldquo;It&rsquo;s a 125 and it can scream,&rdquo; Tony said of the beautiful machine he created. &ldquo;The name has a purpose. I&rsquo;m stirring up a little bit of hell. What&rsquo;s wrong with being a little bit of a menace? That&rsquo;s kind of where my head was at when I sat down to design this bike. I want to grow my shop [Jeske MX Customs] and do things for a reason. I wanted to be different, raise some hell, and make a statement.&rdquo;</p>\r\n<p>In only a couple short weeks, the Fasthouse crew will be making the trek up to Washington to do just that&mdash;make a statement with Durham screaming Jeske&rsquo;s Hell Raiser up the hills of Washougal. But according to Durham, he still has one thing to learn&hellip;&ldquo;I&rsquo;m gonna have to figure out if it&rsquo;s a first or second gear start (laughs).&rdquo;</p>\r\n<p>The Pacific Northwest better watch out&hellip;</p>\r\n<p>If you want to see Durham ripping his personal 125, check out <a target=\"_blank\" href=\"https://www.youtube.com/watch?v=YdTjP43R6Ck\">THIS VIDEO</a>. Yeah, we're pretty sure he'll do the Hell Raiser justice.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 67, type: "DocumentPart::HtmlContent", title: "", content: "<p>Sometimes you just have to get back to your roots. After being on the road all year, Mike LeGrand and I loaded up the van to head east for one more cross-country adventure&mdash;this time to Pennsylvania for some family time, good riding, and good times.</p>\r\n<p>Driving straight through the midnight storms, we finally arrived at Mike's at 7:00AM. And after spending months without his girls&mdash;and by girls, I mean bikes&mdash;Mike immediately woke up his Mom and started putting his bike together for an afternoon of riding with the boys at our local riding spot called Switchback. We had a ripping crew of riders and the track was a radical change from California&mdash;no hard-packed blue groove, just plenty of traction. There's nothing like a day of riding with your buds! It was my first time riding with my brothers Shane and B-rad in a couple years, so it felt like a family reunion on the track. Motorcycles are in the blood for our tight crew.</p>\r\n<p>After riding, I headed over to my Grandma's for dinner. I was greeted with my littlest brother Isaiah, already in his riding gear, as he ran to the garage stoked to show me that he could now start his 50. I hooked him up with a new set of goggles, which he broke in properly by burning a track in Grammy's lawn before dark. Needless to say, she wasn&rsquo;t too thrilled, but Isaiah had one hell of a time. Just as the sun went down, my Mom hollered us in for dinner, as it was time to share stories and eat some home cooked goodness with the fam.</p>\r\n<p>As if that wasn't enough for the first day, right after dinner we heard about a big \"field party\" going on that night in my hometown. Without hesitation, we grabbed the cameras and piled in the van to check it out. We pulled up to over 300 people jamming to a cover band on a makeshift stage. The best part, a slip-n-slide going right down to the front of the stage. The beer was flowing like water, which to our delight, resulted in a ladies topless slide-off, proving to me, that American's go harder than any other country we've been to this year&mdash;including Amsterdam.</p>\r\n<p>The next morning, I headed over to the PR2 Race Shop for some bike prep and to see my Pops. I was drenched in sweat from changing tires in the summer heat when he showed up and gave me a hug. He then promptly told me to get a job... Little does he know, my life is a traveling circus, and when I heard that the Hookstown Fair was throwing another race, I thought it would be the perfect opportunity to put in a little work. To which he replied with a laugh, \"Oh yeah, you raced there in &lsquo;96 on a 50.\" I couldn't really remember the race, but twenty years later, I was stoked to be going back!</p>\r\n<p>As we were pulling into the fairgrounds for the race, the memories started rolling back. And then... I saw the Arena. It was much smaller than I remembered, but when I saw the grandstands the memories of racing as a kid came flooding back! I even remembered &ldquo;Mad Mike&rdquo; Jones winning that night in baggy gear on a number 52 Kawi! As it turned out, the evening was just as fun as I remembered. I lined up for the flag start right after the ATV Pro Main and greased my way to a win. After the checkered flag waved and the champagne sprayed, I took my winnings straight over for a lemonade and a stuffed animal, but Dale the Carny ripped me off for five bucks. Frustrated and still in my gear, I hit a couple rides and left my mark on the annual Hookstown Fair.</p>\r\n<p>I've only been home a few days, but it's already been a great trip. More rain, more riding, and more ridiculousness coming next week! Stay tuned! Mike is hard at work on a video, and we still have more good times ahead.</p>\r\n<p>Rubber side down!</p>\r\n<p><em>Words by Darryn Durham</em></p>\r\n<p><em>Photos by Mike LeGrand and Tommy White</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 68, type: "DocumentPart::HtmlContent", title: "", content: "<p>The true legends of motocross usually posess more than just speed and talent on a motorcycle and <a target=\"_blank\" href=\"http://www.thefasthouse.com/when-rules-were-few/magoo-classic\">Danny \"Magoo\" Chandler </a>is a true legend in every sense of the word. With off-track charisma that matched his on-track determination, agression, and speed, Magoo was a tough competitor during his prime. Through his never-give-up attitude and unforgettable antics, Danny earned the nickname \"Wild Child\", as he raced to numerous wins and accolades before a tragic crash at the 1985 Paris Supercross left him parlyzed. Since that time, Danny was a major proponent for motorcycle safety until his untimely passing at the age of 50.</p>\r\n<p>We're big fans of the sport and its rich history, which is why we take care to look back at the legends that shaped motocross into what it is today. Check out some shots of Magoo, and watch the brief clip from the documentary about him entitled \"Magoo: The Story Of Danny Chandler\". We also have a lot more history on Fasthouse.com, which is easily accessible by <a target=\"_blank\" href=\"http://www.thefasthouse.com/when-rules-were-few\">clicking here</a>.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 69, type: "DocumentPart::HtmlContent", title: "", content: "<p>Steve Haughelstine has been a long-time friend and supporter of Fasthouse. Most noteable, though, he was one of the featured riders for the recent Point Break remake and won gold as a filmer for last year's X Games Real Moto competition. This year, he did things his way. And after earning an invite to the contest, he decided he would not only produce another bad ass segment, but he would do it by filming himself riding and then edit it all together; escentially doing the job of three people all by himself. What he came away with is not only jaw-dropping for the simple fact that he filmed it himself and rode in it, but the shots and riding in the video are incredible. He even did drone shots alone, setting the drone on waypoints and then timing it to be at the perfect spot when he took off each jump. Watch, enjoy, and don't forget to vote for him.</p>\r\n<p><strong>VIDEO:</strong><br /><a target=\"_blank\" href=\"http://xgames.espn.com/xgames/real/17219263/haughelstine-17219717\">X GAMES REAL MOTO | STEVE HAUGHELSTINE</a></p>\r\n<p><em>[UPDATE]</em></p>\r\n<p>After the show aired this past weekend, it was announced that Haughelstine took the gold medal. And since he not only rode in the video, but shot it and edited it himself, he was awarded two golds. Congrats on the medals and excellent job, Steve!</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 70, type: "DocumentPart::HtmlContent", title: "", content: "<p>Here at Fasthouse, we're fans of anything that's fast, loud, and just generally puts a smile on our faces. Recently, our good friend Arik Swan invited a bunch of bad ass motocross riders&mdash;including our own Tyler Bereman&mdash;and mountain bikers to his picturesque property just outside of Santa Cruz, California, for some good times and big air. Dubbed the Swanfest, it's a get together that we could see ourselves enjoying, and we came across this rad video from a young and talented filmer named Nate Jones. In honor of Swan killing it in the 30-Plus Class at Loretta's this past week where he took home the title in convincing fashion, we thought it was a fitting share.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 71, type: "DocumentPart::HtmlContent", title: "", content: "<p>Back in the early days of motocross, Mel Stoutsenberger could be seen on the side of the track with his camera in hand, dodging roost and snapping some rad photos. He was also a regular on the blossuming BMX scene, documenting the early years of a sport that is now almost manditory for most kids growing up. Today, Mel still shoots and is a regular at the annual Red Bull Day In The Dirt. For this week's throwback post, we dug into the Fasthouse Archives to find some amazing shots that Mel has snapped over the years. He's also featured on our Locals page. If you're a fan of old school moto&mdash;or just cool imagery&mdash;do yourself a favor and click the link below to see more of his work.</p>\r\n<p><a target=\"_blank\" href=\"http://www.thefasthouse.com/locals/mel-stoutsenberger-local\">THE SHOOTER</a></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 72, type: "DocumentPart::HtmlContent", title: "", content: "<p>With the red lights of Amsterdam glowing on the horizon, the final morning of Zwartecross arose with the sweat and smell of 220,000 people on disfigured festival grounds, and the final Superklasse of the weekend set to hit the track. While working his way into fourth in Saturday&rsquo;s motos, Durham caught is knee on a deep inside rut, twisting it until feeling a pop, claiming the Medial Collateral Ligament along the way. With a stiff hobble made worse by eight-plus kilometers of walking the night before, the decision was made to ride opening ceremonies, pop some wheelies, and call it a wrap with some decent mobility still in play while Tyler Bereman carried the torch for &lsquo;Merica in the final motos. Also onboard with TB was Yumi&mdash;The Viewing&rsquo;s beloved Burnt Toast movie extra and portable blow up doll with &ldquo;luscious&rdquo; lips&hellip; and uh, other parts as was claimed on the box she arrived in.</p>\r\n<p>With &ldquo;Dicke Titten Kartoffelsalat&rdquo; blaring over the loudspeakers and drunken, cheering Euros lining every inch of fence, the parade lap commenced. Durham was to escort &ldquo;Fatty Patty&rdquo; on the front of the 420 machine, but she clipped a foot on the exhaust pipe and deflated, abandoned in the staging area watching her friends ride off into the fray. Along with European Von Zipper Freewheeler Tristan Purdin, they roosted the shit out of raging fans, popped wheelies, and made an epic toss out for the fans, sending Yumi onto the next chapter of her illustrious life.</p>\r\n<p>After Tyler clipped the gate hinge from a second row start, he was awarded with the worst start of his career, but he still put his head down and got to work. Just before gate drop, he ripped off his ZwarteCross wristband which was cinching up on his right forearm, cutting off circulation and causing it to pump up like a piece of cauliflower. The newfound blood flow literally gave him back eight seconds a lap, putting down his best laps and most impressive ride of the week; even earning and invite to race the infamous Lommel event in Belgium the next weekend. Respectfully, he declined&mdash;European sand riders are no joke, and everyone was ready to log some R&amp;R in Amsterdam.</p>\r\n<p><b>DEATH CRUE WESTBOUND, NEXT STOP: THE ROYAL AMSTERDAM HOTEL</b></p>\r\n<p>For the next 3 days, they&rsquo;d switch from motorcycle racers to tourists. Decked out in fresh American gear from Fasthouse, DC, and Vonzipper, they stuck out like sore thumbs as they hit the streets in search of smoke-filled coffee shops, good times, and the finest pleasures that the city might have to offer. Over three days, the crew discovered art by Banksy, plentiful pre-rolls, catcalling women yelling, &ldquo;Blondie!&rdquo; to Bereman, espresso and truffles, and best of all&hellip; English speaking humans. Slightly intimidated by streets and buildings built in the early 1500&rsquo;s that are best navigated by bikes, it was exactly the cultural trip they&rsquo;d been hoping for. Amsterdam is a place best experienced rather than told about. While semi-legal weed and sinful sex are the lead-offs to every foreigner&rsquo;s Amsterdam tale, there&rsquo;s much more to the city than relaxed rules. It&rsquo;s a cultural melting pot, teeming with life and stories of self-expression that does not exist in the United States. Things in America are too new, too sanitized, and too politically correct. Making some awesome new friends along the way, The Viewing scored their first taste of Europe and fell in love.</p>\r\n<p>Be on the lookout for more global misadventures, even less f*cks given, and more creativity than ever coming out of The Viewing and their band of media marauders. They&rsquo;re challenging every established norm, smashing paradoxes, and proving to motorcycle riders that the best ride is the one where you have the most fun. We&rsquo;ll leave first place to the jocks, because when you&rsquo;re the happiest dude out there, you win every time, no matter what.</p>\r\n<p><strong>PREVIOUS REPORTS</strong></p>\r\n<p><a target=\"_blank\" href=\"http://www.thefasthouse.com/the-scene/articles/the-viewing-packin-black-road-report-number-one\"><strong>Number One</strong></a></p>\r\n<p><a target=\"_blank\" href=\"http://www.thefasthouse.com/the-scene/articles/the-viewing-dicke-titten-kartoffelsalat-road-report-number-two\"><strong>Number Two</strong></a></p>\r\n<p><em>Photos and Words by Aran Eversman</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 73, type: "DocumentPart::HtmlContent", title: "", content: "<p>It&rsquo;s always fun looking back on good times with good people. A couple years ago, while Fasthouse was steadily gaining notoriety&mdash;and the jerseys were cranking out and selling like hot cakes&mdash;Sean Collier got an invite to race with the Ox Motorsports team aboard their CRF450X at the annual Glen Helen 24 Hour event. Without hesitation, he took the invite, and we set up camp in the pits&mdash;in true FH style of course with an Airstream, tasty BBQ, and ice cold brews&mdash;in order to document the race in its entirety.</p>\r\n<p>What transpired was a story that has to be seen to fully understand. The race itself didn&rsquo;t go as planned for the foursome of Colton Udall, Ian Young, Mark Samuels, and Sean Collier, but it wasn&rsquo;t for lack of trying or preparation. Bad luck hindered them the entire 24 hours, relegating them to a runner-up finish. What we came away with was a three-part series of videos telling the full story&mdash;raw and gritty&mdash;about what truly went down. If you missed the video series, shame on you. It&rsquo;s a very entertaining glimpse into the world of professional off-road racing, team work, and what it takes to finish a 24 Hour motorcycle race. Click the link below to go to our video page, scroll down, and you&rsquo;ll find all three episodes. Oh, and grab a cold brew&mdash;or whatever your drink of choice is&mdash;kick up your feet, and enjoy.</p>\r\n<p><a target=\"_blank\" href=\"http://thefasthouse.com/videos#24hour-Ep1\">24 Hours In Black And White</a></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 74, type: "DocumentPart::HtmlContent", title: "", content: "<p>Our last entry signed off from the backseat of a Volkswagen mini van bound for ZwarteCross, where The Viewing&rsquo;s Darryn &amp; Tyler arrived a mere 20 minutes later to a giant-faced man, extremely upset by their lack of credentials and a mean u-turn over a double white line that seemed perfectly kosher to those of us from the states. In a land where everyone speaks multiple languages and we&rsquo;re stuck using hand signals and words like &ldquo;no understando&rdquo;, they quickly realized that the joke is on Americans when it comes to traveling overseas.</p>\r\n<p>In the riders paddock stood a lone race transporter: A badass flat front semi in full World Motocross dress. Darryn and Tyler were about to find themselves back in the factory saddle pitting out of the &uuml;ber-plush F&amp;H Kawasaki rig. Owned by the Harry Fase and his family, they made sure we were comfortable and introduced their new, awkward American friends to the family. Sending them towards the festival grounds with a knowing smile, they knew that there was no preparing for the weirdness ahead. Exchanging cash for Muntens and hopping bar to bar, the boys found themselves in a surreal world of LARPers, post-apocalyptic death machines, deep house music, and drag queens in a true cultural melting pot&mdash;no quarter asked and none given. Pumping the obnoxiously addicting party-song &ldquo;Dicke Titten Kartoffelsalat&rdquo; (Dutch for Big Tits and Potato Salad) on repeat around the grounds, it became clear that this is not your typical American motocross event. While the motocross race is the centerpiece of this festival, it&rsquo;s the 16 main stages and an endless flow of Grolsch beers that floated this one to 220,000+ attendees in 2016. About 300 Euro in Muntens, six carnival rides, and a few luckies later, the boys hit the sack just before sunrise and ready to put the #69 and #420 Kawi&rsquo;s to work.</p>\r\n<p>Pushing 30-degrees Celsius with 100 percent humidity, the festival packed in as the grounds quickly deteriorated; grass turning to dirt and an overwhelmingly heavy funk arising that falls somewhere between city dump and port-o-john. It&rsquo;s part of the experience&mdash;gross by U.S. terms, but perfectly acceptable in the name of rowdy partying in the Dutch countryside. On the track, motos included some conventional &ldquo;amateur&rdquo; style classes starting with 50cc&rsquo;s and ramping all the way up to marquee races like Heels on Wheels, Zwaargewichtklasse (party floats, soviet tanks, motorcycles&hellip;anything goes!) and the signature Superklasse where TB and DD were about to throw down.</p>\r\n<p>Bringing American riders to the ZwarteCross gets the crowd amped up. The sand tracks of Europe are different than the states and there&rsquo;s nothing Dutch fans love more than to see their local heroes go bar-to-bar with American motocross riders, on a course that the local advantage weighs heavy. Lining up for Moto one, Durham and Bereman both ripped mid-pack starts on top of Pirelli sand tires with 30,000 fans waiting to see what they could do. Durham mounted a charge early, ringing out his stock 450 and working his way into 8th place. With 2 laps to go and zero hours on the motor, seals started to give way and white smoke signaled impending doom. Shutting down on the last lap, Durham found his motor melted down and a DNF marking moto moto. Meanwhile, Bereman found himself recovering from a second-row start and working to find his flow in the deep sand but finishing the moto with confidence and good sprits.</p>\r\n<p>The following hours were tense as the boys promised to take it easy on the bikes, as DD&rsquo;s fresh 2017 was already toast. The mechanics huddled with the team owner and sourced a race bike for the morning. It was a gesture of support that showed the tradition of family is still alive here in Holland. The Fase&rsquo;s welcomed us in, and moved mountains to make sure that both Darryn and Tyler were taken care of.</p>\r\n<p>Suspense mounted with the afternoon heat as the 5:30 PM moto prepared to start. Back on the gate, Durham&rsquo;s #420 plates weren&rsquo;t the only hint to the smile on his face&mdash;he was back, ready to rip, and confident in the motorcycle beneath him. Holding a tight inside around he first corner and fighting for a 7th, Durham diced with regional and World Motocross pros into fourth or fifth position, while announcers in multiple languages belted out the play by play. Looking aggressive and confident, the fans lining the fence lines were treated to the kind of DD steeze the world hasn&rsquo;t seen since his last season racing U.S. Nationals. Just as podium contention started to become a reality, the announcers bellowed &ldquo;Darryn, get up Darryn!!!&rdquo; signaling that he had gone down, knifing the front end and remounting in mid pack just as his teammate Tyler Bereman made the move by. Watching the Americans battle side-by-side was the bittersweet reward of the moto, but nothing was as cool as seeing Darryn return to his signature form when the going got tough.</p>\r\n<p>As the sun set around 10:00 PM, the boys laced up their DC&rsquo;s and prepped for the many kilometers ahead, roaming the 137 acre festival grounds into the wee hours with friends they had yet to meet. With the Reggae tent at the top of the order, the night was young and the Muntens plentiful with one more day of racing on the agenda. Then after that&mdash;three days in Amsterdam&hellip; and perhaps the very last sighting of The Viewing Death Crue again as they disappear into the nooks and crannies of the Red Light District.</p>\r\n<p>Only time will tell how things go down, and the next installment of this blog to wrap up the rest of The Viewing&rsquo;s European adventure. Stay tuned!</p>\r\n<p><em>Words and Photos by Aran Eversman</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 75, type: "DocumentPart::HtmlContent", title: "", content: "<p>In spite of having already done it once before, I was still nervous. But when Roland Sands and Cameron Brewer ask you if you want to ride a custom Roland Sands Designs Indian Scout in another Super Hooligan race at the second annual Lost Highway Show in San Bernardino, California, you don&rsquo;t pass it up.</p>\r\n<p>Held at the San Manuel Amphitheater just behind Glen Helen Raceway, this year&rsquo;s Lost Highway show featured a ton of bands, countless motorcycles on display, plenty of beer, and a Super Hooligan race presented by Roland Sands. Cut into a grass field in the middle of everything, the small Hooligan track was prepped and maintained by Speedway legend Brad Oxley and his crew, which included his sons&mdash;successful off-road racers that you&rsquo;ve likely heard of&mdash;Colton Udall and Ian Young.</p>\r\n<p>When I arrived, my anxiety peaked as I walked the track. On paper, riding on fresh grass sounds like any two-wheel enthusiast&rsquo;s dream, but when it comes down to it, grass is slicker than a whiskey fart on a hot summer day&mdash;especially when your bike is equipped with dirt track tires and no front brake. Oh, and it weighs over 500 pounds. Prior to practice, I tried to remind myself of the skills I learned during my first foray into the world of Hooligan competition in Las Vegas, and put it out of my mind that grass was going to make for an experience. And as it turned out, it didn&rsquo;t take long before things got interesting.</p>\r\n<p>As I sat waiting for my first practice session, I looked up just in time to see Cameron Brewer high-side into turn three and gracefully tuck and roll before popping up on his feet to push his bent up Harley off the track for repairs. But that was tame compared to what happened next. Right at the conclusion of the third session we all watched at Shawn Guardado went down in turn four before getting run over by another rider. As Shawn laid on the track motionless, everyone held their breath with a look on their faces, as if to say, &ldquo;This is going to be way&mdash;like a lot&mdash;sketchier than anticipated.&rdquo; Thankfully, Shawn got up with a smashed helmet and a bad concussion, but otherwise okay. While he walked past staging, I took a deep breath and prepared to pull out onto the track.</p>\r\n<p>I got a total of three sessions in&mdash;15 laps&mdash;before it was time to race, and thankfully I managed to get a little more comfortable with each outing. Even though Hooligan racing is intimidating, once you get the hang of it, it&rsquo;s a damn good time on a motorcycle. After trying to cool down in the 105-degree heat, I lined up for the first heat race, which when it was all said and done, turned out to be more of a battle of attrition than an actually race, as I was the only one left on two wheels after five red flag restarts. I guess you could say, I wasn&rsquo;t trying hard enough, but in reality, I didn&rsquo;t want to get any grass stains on my white jeans. My next race was the semi-finals, which didn&rsquo;t go as planned thanks to a horrible start, causing me to finish third, punching my ticket to the consolation race rather than the main event.</p>\r\n<p>My disappointment, though, quickly changed as I lined up next to Andy Bell. Decked out in his Canadian Tuxedo&mdash;denim vest and jeans&mdash;I knew we were going to have a good time. And after battling back and forth through five restarts, the green flag waved for the final time. I came into the first corner way too hot and directly at Bell. The resulting t-bone high-sided me into another rider, whom I bounced off of and proceeded to set my sights on Bell out front, but it was too late. After the numerous re-starts, I didn&rsquo;t have enough time left to catch Bell who was riding like a madman. With that, I sat on the sidelines and watched the finals with my wife and a cold beer.</p>\r\n<p>I&rsquo;ve said it before, but I&rsquo;ll say it again, Hooligan racing has to be experienced to truly understand. On the surface, it looks like a bunch of&mdash;for lack of a better term&mdash;tattooed hooligans on heavy bikes being used in an application they weren&rsquo;t meant for. In reality, though, the camaraderie between the riders, the challenge of riding the heavy bikes on a dirt track, and the overall good time makes Hooligan racing one of my favorite things to do. As is the case with any form of motorcycle racing, Super Hooligan events bring out the best in people. And just like Steve McQueen said, &ldquo;Just when I think everything is wrong with the world, I come out here and see people having fun on motorcycles.&rdquo;</p>\r\n<p><em>By Brendan Lutes</em></p>\r\n<p><em>Photos by Preston Burroughs</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 76, type: "DocumentPart::HtmlContent", title: "", content: "<p>Somewhere around 5:00 AM on Monday July 18th, the mission began with a rally at The Viewing&rsquo;s secret clubhouse; van primed and the crue bleary-eyed from a zero-sleep night spent working gearbags down to a sub-50 pound weight limit. Captained by Darryn Durham and Tyler Bereman, the Viewing Death Crue is taking the roadshow global to wave the flag for professional funhavers worldwide.</p>\r\n<p>The destination: ZwarteCross, the only motocross race of it&rsquo;s kind that pulls elements of motocross racing, music festivals, and over the top misbehavior into a four-day format for the records books. Let it be known: Training for this event includes everything that a &ldquo;serious&rdquo; (a word we generally discourage) motocross racer should not. Beer drinking, crashing bonfires, road tripping with buddies, and a six-day bender at the annual Mammoth Motocross a couple weeks back have left everyone in prime shape for racing.</p>\r\n<p>Jetlag is a symptom best cured with a blast of adrenaline and 12oz coldie of your choice, so we pinned it south to Marmedy, Belgium, and rendezvoused with the Fest Series Loose Fest crew. Founded on similar ideals to The Viewing, the Fest Series riders are a worldwide band of freeride mountain bikers that are literally pushing the progression curve to vertical with massive jump lines, a jam-session format and content-driven approach that empowers rider&rsquo;s creativity and emphasis on radness.</p>\r\n<p>Loose Fest at BikePark Ferme Libert is perched upon the rolling hills of Hotel LeGrand Champs: A lodge befitting of the swiss alps (who also shares a last name of our filmer, with the infamous Mike &ldquo;Wu-Tang&rdquo; LeGrand) landscaped by endless rolling fields, dotted by deer, goats and the occasional roaming &ldquo;albino elk&rdquo;&hellip;we think. Darryn lead the 4AM charge to the &ldquo;Elk Barn&rdquo; but couldn&rsquo;t scale the double fences&hellip;the world may never know. Complete with a t-bar lift, the LooseFest course features an opening hit measuring out at 79 feet&mdash;that&rsquo;s 14 feet longer than a standard Supercross triple. Pushing 80 feet to clear the deck on a 20 foot tall bicycle landing is nothing short of mind-blowing, and when you add in motos, it&rsquo;s a recipe for pure space cake magic.</p>\r\n<p>Bereman is a two-time attendee of Cruz Fest, and he pulled immediate respect in his first year when he threw down Truckdriver grabs and a huuuuge NacNac that got away from him and robbed him of an ACL. In spite of that, though, he still managed to show up this year to take the game to the next level. Within an hour of watching the LooseFest mayhem begin, he geared up and cracked a couple whips in salute of a massive full moon that capped the trip in proper form. Durham, on the other hand was riding on a borrowed 2011 Yamaha replete with Kawasaki Rockstar logos on the shrouds. The first kick of the kickstarter snapped it off at the casting line. If that wasn&rsquo;t a sign, it&rsquo;s tank-like handling off the opening drop in line sealed the deal that he better save his magic for the fresh 2017&rsquo;s waiting for us at Zwartecross.</p>\r\n<p>This road report is coming to you from the back seat of a VW Minivan, ripping down the highway at about 30 km/h over the speed limit with ZwarteCross pinned on the GPS navigation. Dayle Dabblesworth still thinks he&rsquo;s on I-15 and his sketchy driving tactics made this story nearly impossible to write on the way, but we got it done to beam the good times back to the states where eager eyes await. Stay tuned for more and remember, you win some, you lose some and you wreck some&hellip;. so ya better make sure you&rsquo;re having the most fun, win, lose, or draw!</p>\r\n<p><em>Photos and Report by Aran Eversman</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 77, type: "DocumentPart::HtmlContent", title: "", content: "<p>Making it as an artist is a dream for many. It&rsquo;s a profession that affords you the ability to make a living being creative, but more importantly doing something you love. For Derek Gibson, art has always been a passion of his, and through perseverance and hard work, he was able to combine painting with his other love of motocross.</p>\r\n<p>Over the years, Derek&rsquo;s skills with a brush and pen have allowed him the opportunity to paint during Supercross events, make some money, and donate his work for charity. With his art popping up all over the place, we decided to check in with him to get a little background on how he got into painting, motocross, and what led to him combining the two.</p>\r\n<p><b>How did you get started as an artist?</b></p>\r\n<p>I&rsquo;ve always liked to draw ever since I was a little kid. Right before racing the Millville Pro National, I had a serious head injury from a practice crash that pretty much put an end to my racing. So one day, I started drawing seriously to see what I could do with my artistic ability. Ever since that day, I&rsquo;ve put everything into my artwork so I wouldn&rsquo;t have any more regrets like I have with racing. Someday I want to be able to look at where I&rsquo;m at, good or bad, with my artwork and know I gave it everything I have.</p>\r\n<p><b>What do you enjoy most about painting?</b></p>\r\n<p>I enjoy putting a smile on someone&rsquo;s face when they see the end result of the artwork.</p>\r\n<p><b>Where do you look for inspiration?</b></p>\r\n<p>I get inspiration from the work of other artists. I always compare my work to theirs and want my stuff to be at their level someday.</p>\r\n<p><b>What do you enjoy most about art?</b></p>\r\n<p>The discipline it has taught me; it has taught me to stay focused. Seeing the rewards of the finished product, and hearing that others enjoy it, is very rewarding. It&rsquo;s also pretty rad when I get text messages and phone calls from some of the top pros in the sport of motocross wanting to have artwork done.</p>\r\n<p><b>What is your proudest accomplishment when it comes to painting?</b></p>\r\n<p>Getting to do interviews with companies like yours, and also being featured in the Five Minute Interview with Derek Gibson in <i>Racer X Magazine</i>. This Supercross season I also got to do artwork, of Jason Anderson, in the pits at the St. Louis round while sitting at the Rockstar Husqvarna semi. Another cool thing from my artwork is seeing my hard work pay off in the world of motocross/Supercross, and being able to donate my work and raise money for great causes and events. I also really enjoy getting to do artwork each year for the Legends and Heros Tour Hall of Fame Rider they have for opening ceremonies at Supercross.</p>\r\n<p><b>What are some goals you have for yourself?</b></p>\r\n<p>To be the best artist I can and to build a name for myself in the sport of motocross and action sports. I also want to grow as an artist, and hopefully be able to do my artwork full-time someday.</p>\r\n<p><strong>Derek's Social Media:</strong></p>\r\n<p><strong>Instagram:</strong> <a target=\"_blank\" href=\"https://www.instagram.com/derekgibson951/\">@derekgibson951</a></p>\r\n<p><strong>Twitter:</strong> <a target=\"_blank\" href=\"https://twitter.com/derekgibson951\">@derekgibson951</a></p>\r\n<p><strong>FaceBook:</strong> <a target=\"_blank\" href=\"https://www.facebook.com/derek.gibson.9250\">Derek.Gibson</a></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 78, type: "DocumentPart::HtmlContent", title: "", content: "<p>We've been busy lately. The new gear arriving, attending the annual Mammoth Motocross, and the post-race clean up that follows has left us with little free time to enjoy aboard two-wheels. But with a weekend finally open on our schedules, it was time to round up the crew and head north of Santa Barbara to our favorite track, Zaca Station, for some throttle therapy, good times, and ice cold 805 brews to sip on after some motos. In spite of hot temperatures that have blanketed Southern California, Ed and his crew prepped the track to perfection and Tammy made sure everything was handled for us when we arrived. Following the track, everyone stopped by the Firestone Brewery in Buellton for lunch before heading home. We'd love to tell you everything that went down, but you're going to have to wait a few weeks for the project to be released. Stay tuned for something rad from the boys at 805 Beer. Until then, though, enjoy this big photo gallery.</p>\r\n<p><em>Photos by Brendan Lutes and Max Mandell</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 80, type: "DocumentPart::HtmlContent", title: "", content: "<p>It's no secret that the Alta Red Shift MX bike is legit, but one of the last remaining boxes that haven't been checked off its bucket list is a backflip. Recently, Fasthouse's own Dustin \"Wacker\" Nowak manned up and flipped the electric motorcycle for the first time, and since then he's been dialing in his list of FMX tricks. Even though the bike has some obvious differences in handling from it's gas-burning brothers from other mothers, the Alta is prooving to be up for the task, as Wacker discusses with <em>TransWorld Motocross' </em>Mike Emery.</p>\r\n<p><em>Video by Mike Emery (TransWorld Motocross)</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 81, type: "DocumentPart::HtmlContent", title: "", content: "<p>The historic Adelanto Grand Prix never disappoints&mdash;it's fast, gnarly, and unforgiving. This year, Fasthouse teamed up with the Chaparral/Precision Concepts/Kawasaki team for the 2018 season. And in spite of some challenges during the race&mdash;Blayne Thompson's broken previously foot and Justin Seeds' bars coming loose&mdash;the riders all finished very well with Clay Hegeveld even taking the Pro II victory and Team Manager Robby Bell dominating the Vet AA Class.</p>\r\n<p><em>Video and Photos by Brendan Lutes</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 82, type: "DocumentPart::HtmlContent", title: "", content: "<p>In the world of Supercross and motocross, Anaheim 1 is the sport's premiere event. Often referred to as \"the Superbowl of motocross racing\", the opening of the season not only marks the beginning of a long 17-week series, but for many racers, it's the first time they get to make the trip down the tunnel and into the stadium to live their dream. For Robbie Wageman, Gage Schehr, and Deegan Vonlossberg, A1 was the begining of becoming one step closer to their ultimate goal of running at the front of the pack at the highest level. While Wageman had already competed under the lights at a few rounds in 2017 before getting injured, Schehr and Vonlossberg were competing in their first-ever SX, and while they did have their ups and downs, all three riders held their own against the best in the business.</p>\r\n<p>When it was all said and done, Schehr and Wageman qualified for the night show in 26th and 31st respectively, while Vonlossberg missed the top-40 by just 1/10th of a second. In the night show, Gage crashed on the start of his heat race before ultimately finishing 20th in the Last Chance Qualifier, while Wageman finished 15th in the LCQ. No matter what happened, though, all of them had a smile on their face the entire time&mdash;and they looked the best while doing it. On to Houston next week!</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 83, type: "DocumentPart::HtmlContent", title: "", content: "<p>Fasthouse today announced its global MTB team. The lineup includes Tyler McCaul, USA GT bikes; Ryan Howard, USA Trek bikes, Bubba Warren, USA YT bikes; and current FMB World Champion Emil Johansson, Sweden Trek bikes.</p>\r\n<p>Mike Redding stated, &ldquo;We are super happy how the team came together, with four super passionate guys that love to ride bikes. They fit our brand perfectly and each of these guys embody our motto, Purveyor of Good Times!&rdquo;</p>\r\n<p>Look out for these guys at events and bike parks around the world.&nbsp; There will be a video dropping in spring with this crew, along with our MTB collection and Bell Helmets co-lab. Keep an eye on Fasthouse.com and the Fasthouse IG account for updates on MTB. Give each of them a follow on their IG accounts: <a href=\"https://www.instagram.com/tylermccaul/\" target=\"_blank\">@tylermccaul</a> <a href=\"https://www.instagram.com/r_doggystyles/\" target=\"_blank\">@r_doggystyles</a> <a href=\"https://www.instagram.com/bubba_warren/\" target=\"_blank\">@bubba_warren</a> <a href=\"https://www.instagram.com/johanssoemil/\" target=\"_blank\">@johanssoemil</a>.&nbsp;</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 84, type: "DocumentPart::HtmlContent", title: "", content: "Dustin “Wacker” Nowak isn’t known for doing things the same as everyone else. With a style all his own, Wacker is widely regarded in the freestyle scene, and among his friends, for always standing out with something crazy. When it came time to get his bike prepped for Day In The Dirt 20, he decided he’d transform his YZ125 into something no one has seen before. And with only a few days before the race, he went to work. The alligator seat cover, which Wacker found material for online, was custom cut and sewn by him, and the idea of having no front fender and round side panels was to give the bike a flat track look.  Underneath the hood, he didn’t change much from what he normally runs—some slight mods, exhaust system, suspension mods, and clutch components.", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 85, type: "DocumentPart::HtmlContent", title: "", content: "<p>This past year has been a good one for Fasthouse. We've launched multiple new gear sets, created tons of memorable content, had numerous some killer days at the track, and cultivated good times whereever we landed. With 2018 just a few days away, and 2017 having been chaulked full of goodness, we thought it was fitting to take a look back at some of our favorite events, pieces of content, and memories from '17.</p>\r\n<p><a href=\"http://www.thefasthouse.com/the-scene/articles/down-for-fun-two-stroke-championships\" target=\"_blank\">Down For Fun | Two-Stroke Championship Video</a></p>\r\n<p>We always make it a point to attend this annual Two-Stroke Championships, and 2017 was no different. This year, Robbie Wageman took victory in the 125 Pro Class, while Sean Collier unfortunately had a hard crash in Open Pro before salvaging a 10th overall.</p>\r\n<p><a href=\"http://www.thefasthouse.com/the-scene/articles/gas-and-beer-805-fasthouse-video\" target=\"_blank\">805 Gas And Beer Video</a></p>\r\n<p>Since the beginning, we've had a close working relationship with 805 Beer. And at the beginning of 2017, the popular SoCal beer released this rad video shot at Zaca Station with the boys. The shoot spawned numerous in-store displays, billboards, and millions of views on YouTube.</p>\r\n<p><a href=\"http://www.thefasthouse.com/the-scene/articles/after-hours-with-sean-collier-featuring-mike-healey\" target=\"_blank\">After Hours With Sean Collier Featuring Mike Healey</a></p>\r\n<p>This year, we launched a new video series, diving into the lives of athletes, artists, stuntmen, and just about anyone that we find interesting. One of the first guests was Mike Healey. And inspite of being out of the racing spotlight for many years, Healey's episode garnered a lot of viewers, as he went into detail about his racing career and the dark turn he took before ultimately becoming a barber. Also, CLICK HERE to watch other episodes.</p>\r\n<p><a href=\"http://www.thefasthouse.com/the-scene/articles/darryn-durham-missing-in-action-the-viewing-s-latest\" target=\"_blank\">Darryn Durham Missing In Action</a></p>\r\n<p>Darryn Durham might not have done a lot of racing this year, but he still had a good time doing what he loves&mdash;riding his dirt bike. In this rad video by The Viewing, Darryn hits up his secret hot SoCal hot spots throughout the epic 2017 winter we had.</p>\r\n<p><a href=\"http://www.thefasthouse.com/the-scene/articles/spring-fling-2017-fasthouse-invades-zaca\" target=\"_blank\">Spring Fling 2017 | Fasthouse Invades Zaca</a></p>\r\n<p>In what is sure to become a yearly tradition, we held our first annual Spring Fling at our favorite West Coast track, Zaca Station. But rather than just show up and spin some laps, we had a BBQ, full band, ice cold 805 Beer for post-ride refreshment, and every person that entered the gate that day rode for free. It was a rad day with even better people.</p>\r\n<p><a href=\"http://www.thefasthouse.com/stories/unforgiving-monster\" target=\"_blank\">Unforgiving Monster | 2017 Glen Helen National</a></p>\r\n<p>We launched a new feature on our website late in 2016, but got the most use out of it this year. If you haven't seen the huge bitchin' <a href=\"http://www.thefasthouse.com/stories\" target=\"_blank\">Fasthouse Photo Stories</a> on our site, you're missing out. One of our favorites from '17 was when we attended the Glen Helen National to cheer on the Fasthouse crew. That day, rather than applying for a photo pass and working out ass off in the heat, getting the same images as everyone else, we elected to shoot it from the fence with a beer in one hand and our camera in the other. The day garnered some good times, unforgettable memories, and most importantly awesome imagery. Young Justin Hoeft also went 11-14 for 14th overall in his first-ever 450 National.</p>\r\n<p><a href=\"http://www.thefasthouse.com/the-scene/articles/speed-style-good-times-at-8-000-feet\" target=\"_blank\">Speed. Style. Good Times | At 8,000 Feet</a></p>\r\n<p>The annual Mammoth Motocross is one of our favorite events of the year. And in '17 we used it as an opportunity to not only have some fun at 8,00 feet with some of our closest friends, but we used it as an opportunity to launch some of our newest gear. The video that came from it all was packed full of racing, pit antics, after hours fun, and more racing. It also generated well into the six figure count in total views.</p>\r\n<p><a href=\"http://www.thefasthouse.com/the-scene/articles/wild-man-bereman-behind-the-scenes-at-x-games\" target=\"_blank\">Wild Man Bereman | Behind The Scenes At X Games</a></p>\r\n<p>Tyler Bereman had a killer year. During his time at X Games, where he took home two medals, we tagged along to document the entire trip behind-the-scenes in the places that the television cameras don't take you.</p>\r\n<p><a href=\"http://www.thefasthouse.com/the-scene/articles/valley-relics-bmx-reunion-nba-memories-with-ernie-alexander\" target=\"_blank\">Valley Relics' BMX Reunion | NBA Memories With Ernie Alexander</a></p>\r\n<p>BMX has been in our blood since the beginning. Fasthouse founder Kenny Alexander's dad Ernie was the founder of the National Bicycle Association, and this year, the Valley Relics Museum in Van Nuys held a super cool reunion commemorating everything BMX. If you're grew up peddeling around town on your BMX bike, you need to check out this gallery.</p>\r\n<p><a href=\"http://www.thefasthouse.com/the-scene/articles/brutal-blayne-thompson-takes-havasu-worcs\" target=\"_blank\">Brutal | Blayne Thompson Takes Havasu</a></p>\r\n<p>Our off-road assassin Blayne Thompson had a blazing start to 2017, taking the win at the Adelanto Grand Prix and following it up with a dominating victory at the brutal Havasu WORCS race. The photos don't to it justice.</p>\r\n<p><a href=\"http://www.thefasthouse.com/the-scene/articles/surf-and-turf-19th-annual-surfercross\" target=\"_blank\">Surf And Turf | 19th Annual Surfercross</a></p>\r\n<p>Being based in SoCal means that the beach isn't far away, and every chance we get, we try to get out in the water. This year, Fasthouse came onboard (no pun intended) with the annual Surfercross event as a sponsor, supplying all the surfers who don't normally ride with new gear. As is the case every year, Surfercross didn't dissappoint and the video prooves that.</p>\r\n<p><a href=\"http://www.thefasthouse.com/stories/the-fastest-party-turns-20\" target=\"_blank\">Red Bull Day In The Dirt 20 | The Fastest Party Turns 20</a></p>\r\n<p>This year's Red Bull Day In The Dirt was a milestone, marking the annual event's 20th year and it was bigger than ever. Not only was just about every racing class sold out, but the barn party was headlined by the Boogie Knights band, 805 Drag Racing was off the hook, and every single person in attendance had a killer time. Next year, DITD turns 21... watch out.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 86, type: "DocumentPart::HtmlContent", title: "", content: "<p>Christmas is just around the corner and this past weekend marked the annual Fasthouse Christmas party at our SoCal headquarters. Our favorite local band showed up and all of our friends and family came out to enjoy our yearly get together. Cold adult beverages were consumed, a table full of catered food was eaten, and good times were had by all that attended. Merry Christmas and happy holidays to everyone!</p>\r\n<p><em>Photos by Brendan Lutes</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 87, type: "DocumentPart::HtmlContent", title: "", content: "<p>&ldquo;What I love about Hooligan racing is how sketchy it is.\" -Jordan Graham</p>\r\n<p>Sure, there have been countless run-what-ya-brung events across the country, but Super Hooligan racing is something special. It brings riders out to compete aboard modified street bikes on flat tracks at interesting venues around The States. One racer that has been at it since the beginning is Jordan Graham. By day, he&rsquo;s a custom helmet painter for Airtrix Custom Paint, but on the weekends, he can be found sliding sideways aboard a 500-pound Roland Sands Designs Indian Scout. &ldquo;Most racing is too serious and no one has fun,&rdquo; Jordan said. &ldquo;At Hooligan races, though, everyone is having a good time while trying to avoid killing each other. It&rsquo;s rad to see how even the playing field is when everyone has no idea what a 500-pound motorcycle is about to do. It can tend to scare the shit out of people.&rdquo;</p>\r\n<p>Witnessing a Hooligan event is one thing&mdash;carnage, near misses, and close racing are just some of the highlights&mdash;but racing one is a completely different animal all together. Getting into it, though, is usually as easy as finding a bike or modifying your own. &ldquo;I got into Hooligan racing after building a street tracker I used to ride to work,&rdquo; Jordan said. &ldquo;I signed up at a local flat track race with a group of other like-minded idiots, not knowing what we were about to get into. After my first high-side crash to my head, though, I knew I was addicted.&rdquo; It&rsquo;s the unexpected, the good times, and the camaraderie with buddies that make Hooligan events one of our favorite forms of racing.</p>\r\n<p><em>Words and Photos by Brendan Lutes</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 88, type: "DocumentPart::HtmlContent", title: "", content: "<p>We begin this week on a somber note. Legendary filmmaker Bruce Brown passed away peacefully last night at his home in Santa Barbara, California. He was 80 years old.</p>\r\n<p>Bruce was an inspiration to generations of surfers, motorcyclists, and filmmakers. His numerous films provided an escape and glimpse into what we all love about what we now call action sports. His break-through film entitled <i>The Endless Summer</i> showed the public why surfing is so beloved by the diehard Southern Californian surfers, bringing the popular SoCal sport to the Midwest masses. <i>The Endless Summer</i> followed surfers around the world, as they chased perfect waves on picturesque beaches, and Bruce perfectly portrayed that lifestyle with his film. What started as a $50,000 investment by Bruce transformed into a national movement for the surfing community, and ultimately garnered millions of dollars at the box office.</p>\r\n<p>For motorcyclists, though, Bruce&rsquo;s next film <i>On Any </i>Sunday has stood the test time, inspiring generations of motorcycle riders by capturing the true essence of why we choose to twist the throttle&mdash;fun, camaraderie, and family. In the beginning, generating funding for the film proved difficult, but after a meeting with, Steve McQueen&mdash;who helped front the majority of the money needed&mdash;<i>On Any Sunday</i> gained the necessary backing for production. The film went on to garner an Academy Award Nomination for Best Documentary, and has since become an iconic piece of motorcycling history. In the years following the release of <em>On Any Sunday</em>, follow-up films have been produced. Most recently, Bruce's son Dana produced <em>On Any Sunday: The Next Chapter</em>, which was released in 2014.</p>\r\n<p>Here at Fasthouse, Bruce was a friend and he will be missed dearly. When we produced the <i>Day In The Dirt</i> film back in 2002, during the fourth DITD event, Bruce graciously allowed never-before-seen footage from <i>On Any Sunday </i>to be used in the film. Bruce will forever be remember for his film legacy, but he will also be remember for the amazing man he was. Godspeed, Bruce.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 89, type: "DocumentPart::HtmlContent", title: "", content: "<p>Yes, it's another post about this year's Red Bull Day In The Dirt, but can you blame us? This year's event was full of good times, and it was well covered and represented by many of the local SoCal motocross magazines. Click the links below to peruse some of the rad stories and videos brought to you by Racer X, TransWorld MX, and Dirt Bike Magazine.</p>\r\n<p><a href=\"http://racerxonline.com/2017/11/28/racer-x-films-day-in-the-dirt-vibes-part-i\"><strong>Racer X Day In The Dirt Vibes</strong></a></p>\r\n<p><a href=\"http://racerxonline.com/2017/11/28/racer-x-films-day-in-the-dirt-vibes-part-i\">Part 1</a></p>\r\n<p><a href=\"http://racerxonline.com/2017/12/01/racer-x-films-day-in-the-dirt-vibes-part-ii\">Part 2</a></p>\r\n<p><a href=\"http://racerxonline.com/2017/12/04/racer-x-films-day-in-the-dirt-vibes-part-iii\">Part 3</a></p>\r\n<p><a href=\"https://motocross.transworld.net/photos/2017-a-day-in-the-dirt-photo-gallery/\">TransWorld MX Photo Gallery</a></p>\r\n<p><a href=\"https://motocross.transworld.net/videos/2017-a-day-in-the-dirt-the-yamahauler/\">TWMX Yamahahauler Tour</a></p>\r\n<p><a href=\"https://dirtbikemagazine.com/day-in-the-dirt-2018-20-years-of-good-times/\">Dirt Bike Magazine Photo Gallery</a></p>\r\n<p></p>\r\n<p></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 90, type: "DocumentPart::HtmlContent", title: "", content: "<p>The Fastest Party In Town turned 20 this year, and the annual pilgrimage to Glen Helen Raceway wasn't short of good times, laughs, and of course, racing. Day In The Dirt is an event that you don't want to miss, and The Viewing crew was on hand this year, documenting the fun. Since Darryn Durham is currently on the injured reserve list, he was running around with his camera and sticks, capturing it all. If you missed the huge Fasthouse photo story we posted from the event, <a href=\"http://thefasthouse.com/stories/the-fastest-party-turns-20\">CLICK HERE</a> when you're done watching the video.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 91, type: "DocumentPart::HtmlContent", title: "", content: "<p>What began as a small gathering 20 years ago, Red Bull Day In The Dirt has grown into one of the largest events on the west coast, drawing thousands of spectators and riders from all across the U.S. and this year's event was nothing short of epic. Nearly every class was sold out and \"the fastest party in town\" delivered good times over the course of the Thanksgiving weekend. Friday began with Happy Hour practice and a short SoCal Reunion race followed by the 805 Friday Night Drag Races; which led into the weekend's racing, Hell On Wheels TT race, and the rad barn party where the Boogie Knights played for a packed house. If you missed this year, you missed the best DITD yet. Scroll through this huge FH Story to relive all the memories.</p>\r\n<p><a href=\"/stories/the-fastest-party-turns-20\"><img src=\"https://fasthouse.s3.amazonaws.com/media/uploads/btn-photostory.png\" /></a></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 92, type: "DocumentPart::HtmlContent", title: "", content: "<p>Darryn Durham and The Viewing are always up to some rad stuff. And even though you've likely seen DD ripping around on an electric Alta bike lately, it doesn't mean that he hasn't been spending time aboard his traditional 450. While back east this year, The Viewing put together this bad ass piece titled \"Desolate\" with some of the coolest and most original imagery seen in a motocross video in a while.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "right"},
  {document_id: 1, type: "DocumentPart::HtmlContent", title: "", content: "<p>It&rsquo;s only been about a month since we announced that Fasthouse was officially entering the mountain bike world, but we&rsquo;ve already hit the ground running. And making the trek out to Utah this past week for the annual Red Bull Rampage event was just the beginning of what is sure to be a killer journey. Held over the course of a week, Rampage pits mountain biking&rsquo;s best free ride athletes against each other on arguably the gnarliest course on the planet, as riders navigate sheer cliffs, and massive gaps, at nearly incomprehensible speeds.</p>\r\n<p>In a last-minute wild card entry, Fasthouse&rsquo;s first MTB athlete Ryan &ldquo;R-Dog&rdquo; Howard spent nearly two weeks in Utah, preparing his run and getting acquainted with the treacherous terrain. Styling in some of our moto gear, R-Dog held his own, as he completed two solid runs with rad style and soul. Following his final run&mdash;and with an ice-cold beer in hand&mdash;R-Dog had this to say in the finishing corral. &ldquo;I&rsquo;m so honored to be a part of this event, and rep the Fasthouse gear,&rdquo; he said. &ldquo;I&rsquo;m not here to win this thing, I&rsquo;m here to show people what riding bikes is all about! Hanging with the boys, laying down a couple runs, and crackin' a beer to celebrate the good times.&rdquo;</p>\r\n<p>R-Dog&rsquo;s fun-loving attitude is contagious&mdash;good times, throwing whips, and laughing with buddies is what MTB and moto are all about. And since inking his FH deal, we&rsquo;ve known he was a perfect fit. &ldquo;The first time I met Kenny [Alexander], we were talking about big events like Rampage,&rdquo; R-Dog said. &ldquo;I told him that I&rsquo;m not the most competitive person, and he didn&rsquo;t seem to care. His reply was, &lsquo;Just go out there, have fun, look good and throw some whips to stoke people out.&rsquo; Those are some words to live by!&rdquo;</p>\r\n<p>If you missed any of the Rampage action, you can check it out by <a href=\"https://www.redbull.com/us-en/events/rampage\" target=\"_blank\">CLICKING HERE</a>. Stay tuned for more MTB news from Fasthouse!</p>\r\n<p><em>Photos by Garth Milan</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 2, type: "DocumentPart::HtmlContent", title: "", content: "<p>Usually road trips aren't very fun. They're long, boring, and a way to get somewhere you need or want to be. But with the Sturgis Motorcycle Rally, and Crankworx, approaching a few months ago, Drew Rohde, Nic Hall, and photographer Samson Hatae decided to embark on a road trip of a lifetime, mounting their mountain bikes to the backs of their Harleys and riding to the infamous biker rally before heading to Crankworx in Whistler, B.C. After watching the video, check out the link below for their full story.</p>\r\n<p><a href=\"http://theloamwolf.com/index.php/2017/09/19/bikes-roadtripping-sturgis-crankworx/\" target=\"_blank\">LOAM WOLF BIKES ON BIKES</a></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 3, type: "DocumentPart::HtmlContent", title: "", content: "<p>Our friends are rad, and Manny Gasper loves to build bad ass bikes for us to enjoy. In a project that started nine months ago, Manny teamed up with renowned engine and bike builder Luc \"Frenchie\" Caouette to create one of the coolest two-strokes around. Wanting to build not only a good-looking machine, but a fire-breather, Frenchie and Manny decided to bore the YZ250 out to a 300 and provide the internals with everything to make the bike absolutely rip. When it was all said and done, the YZ300 that has been lovelying dub \"Black Sabbath\" is one insane machine to look at, and it's music to the ears when it's ripping around a track. Stay tuned for our plans with the bike...</p>\r\n<p><em>Photos by Brendan Lutes</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 4, type: "DocumentPart::HtmlContent", title: "", content: "<p>We are currently only one week away from entries opening for the <a href=\"http://www.dayinthedirt.com/\">20th Annual Red Bull Day In The Dirt</a>&mdash;October 2nd to be exact&mdash;and we're counting the days to Thanksgiving weekend when the motorcycle and Hollywood community decend upon Glen Helen Raceway to enjoy a weekend at the track, camping, bench racing, and twisting the throttle. We have some big things planned for year 20 of the \"fastest party in town\"&mdash;a live concert from The Boogie Knights, the 805 Beer Drag Race, Happy Hour, partying, racing, and more, making the 2017 DITD one you don't want to miss. This year is going to be bigger than every, and to get pumped up, we thought we'd share this rad video from last year produced by MotoSport Outlet. Enjoy, and don't forget to mark your calendars!</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 5, type: "DocumentPart::HtmlContent", title: "", content: "<p>Professional driver, motorcycle rider, Pikes Peak Champion, and stuntman. Greg Tracy has done it all&mdash;including the infamous Hot Wheels loop at X Games a few years back. Hear his stories and more in this episode of After Hours.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 6, type: "DocumentPart::HtmlContent", title: "", content: "<p>In case you haven't noticed, there's a silent movement happening in the sport of motocross. Over the past few years, Alta has been making major strides in manufacturering a race-ready electric motocross bike. And after spending numerous days at the track with the Alta crew, Darryn Durham decided to put the machine to the test, racing in the annual TransWorld Motocross Slam event at Milestone MX Park. <a href=\"http://www.thefasthouse.com/stories/durham-goes-silent\">CLICK HERE</a> to check out a rad <strong>photo story</strong> from the day, and find out exactly how it all went down.</p>\r\n<p><em>Photos by Alta Motors</em></p>\r\n<p><a href=\"/stories/durham-goes-silent\"><img src=\"https://fasthouse.s3.amazonaws.com/media/uploads/btn-photostory.png\" target=\"_blank\" /></a></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 7, type: "DocumentPart::HtmlContent", title: "", content: "<p><strong>Press Release</strong></p>\r\n<p><strong>Punk rocker and mountain bike industry veteran Mike Redding to lead the charge</strong></p>\r\n<p>Santa Clarita, CA &ndash; (Sept. 11, 2017) &ndash; Fasthouse, the motocross gear and clothing brand, is making their debut into MTB. With a collection that suits all different kinds of riding with individual style for everyone, the brand will debut in spring 2018.&nbsp;</p>\r\n<p>Fasthouse founder Kenny Alexander said, &ldquo;We are excited to bring the Fasthouse moto style into the MTB world. Drawing from our moto background of having fun and racing sometimes, will fit in nicely into the MTB line that Fasthouse will be launching in spring. We are totally stoked to add Mike Redding to the team. I love his style. He will fit into our family perfectly. I can&rsquo;t think of anyone else better to get our mountain bike division rolling.&rdquo;</p>\r\n<p>Redding comes to the company with 18 years of experience in marketing, with an emphasis in mountain bike sports marketing, having most recently worked at Fox Racing and prior to that, Troy Lee Designs.</p>\r\n<p>&ldquo;I was excited when Kenny gave me the nod to head up their MTB program at Fasthouse,&rdquo; said Mike Redding.&nbsp; &ldquo;What drew me into this company is the edge and punk rock attitude that shows in their moto gear and their athletes. I&rsquo;m looking forward to building a fun team to do videos and movies and throw some great parties along the way. We will be the Purveyor of Good Times!&rdquo;&nbsp;</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 8, type: "DocumentPart::HtmlContent", title: "", content: "<p>Back in the 1970s and '80s, Michael Runyard was one of the fast guys at motocross races, competing against the likes of Brad Lackey, Heikki Mikola, Roger DeCoster, and more. Over the years, we've been lucky enough to have Runyard share his memories and some of his pricelss photos from his racing days. Following his racing career, he transitioned into Hollywood stunts where he became one of the most well-respected stuntmen in the industry. If you've missed some of the other posts abotu his stunt days, <a href=\"http://www.thefasthouse.com/the-scene/articles/iron-eagle-stunts-looking-back-with-michael-runyard\" target=\"_blank\">CLICK HERE</a> to learn about the iconic Iron Eagle airplace chase scene, and <a href=\"http://www.thefasthouse.com/the-scene/articles/bond-and-motorcycles-michael-runyard-on-stunts\" target=\"_blank\">CLICK HERE</a> for behind-the-scenes on a James Bond film. Below are some memories that Runyard wrote for us.</p>\r\n<p><em>Photo 1: Here I am getting the holeshot at the Unadilla Trans-Am in 1974. Runyard (6), Roger DeCoster (69), Jim Pomeroy (12), Bengt Aberg (11), Jan-Eric Sallqvist (25), Raymond Boven (10).</em></p>\r\n<p><em>Photo 2: Roger DeCoster setting me up for a pass just before the right hand turn down the Cork Screw Hill for the u-turn left, I beat him to the bottom, but he braked early and tucked inside at the bottom and passed me going up Cork Screw Hill at the Unadilla Trans-Am in 1974. Lesson learned, thank you Roger, we laughed later&mdash;at least I did&mdash;he just smiled. He was fast, and had great cornering speed just like Ryan Dungy.</em></p>\r\n<p><em>Photo 3: Trans-Am Lexington, Ohio (Mid-Ohio) in 1973. This photo has an interesting story. Mostly all the tracks where natural terrain, even Mid-Ohio, except this year. In this long sweeping turn before the uphill to the finish line, they had built these three humps, and the third one&mdash;that you cannot see in this photo&mdash;is farther apart than the first two. For the most part, everybody was just jumping the first two. My Mom took this photo during the last practice, and prior to it, she told me that Heikki Mikola had just jumped all three. On the last lap, I waited for him to go by and had to ride like hell for a lap to try and keep up with him. Look at all the people watching him do this jump. If you look right behind the guy in Honda shirt and the guy in the Yamaha shirt, both the team racing managers, you can see me watching Heikki do this. I did not start jumping all three until the second moto.</em></p>\r\n<p><em>Photo 4: Here&rsquo;s another photo that my Mom took. It&rsquo;s Gary Jones the 1972 Inter-Am 250 in Boise, Idaho. This was the Longest and Steepest downhill that we ever raced. It was steeper than Mammoth and four times longer. You could still go pretty fast, though, because it was soft and deep. Look at all the different lines we made.</em></p>\r\n<p><em>Photo 5: These results were from the Evel Knievel Snake River race. Check out the prize money; that was big prize money for back then. The interesting story here was that after we finished the races, we had a jump contest, and I went second to last in full motocross gear. I went into the lead going nine feet farther than anybody else. The last guy to jump was Kenny Zahrt. He pulled up to the starting spot with a t-shirt on, a pair of jeans, and I swear to God he was wearing a pair of Hush puppies for shoes. He proceeded to blow all of us off, going 18 feet further than me. I don&rsquo;t think he even raced that day and I think he borrowed a 360 Bultaco from either Tom Rapp or Ron Pomeroy. We all laughed and congratulated him. He rang that Bultaco out, shifting gears all the way to the take off ramp and he flew so far&mdash;it was beautiful.</em></p>\r\n<p><em>Photo 6: I found another photo that my Mom took at WestLake on a Montesa. Not sure what year this was&mdash;1968 to 1971? I don&rsquo;t know if the photo is damaged from old age, the light, the exposure, or dust?</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 9, type: "DocumentPart::HtmlContent", title: "", content: "<p>The full video parts for X Games Real Moto just dropped and Tyler Bereman's is rad. Chalked full of incredible riding, including an unbelievable leap over a house, TB's edit doesn't dissappoint. Check out the teaser, then <a href=\"http://xgames.espn.com/xgames/real/20123805/bereman-20123950\">CLICK HERE</a> to watch the full video and vote. You can vote once a day, so be sure to visit regularly until the voting closes on August 28th at 9:00AM Eastern time.</p>\r\n<p><em>Video by Ryan Walters</em></p>\r\n<p><em>Photos by Ryne Swanberg</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 10, type: "DocumentPart::HtmlContent", title: "", content: "<p>Southern California has long been the hot bed of motocross, and back in the 1960s, &lsquo;70s, and &lsquo;80s, Saddleback Park was one of the most iconic facilities in MX, producing some unforgettable moments in motocross history. Originally opened back in 1967, Saddleback quickly grew in popularity, as it&rsquo;s various track offerings and open riding areas attracted riders from all over the country and even the world.</p>\r\n<p>The list of legends who have competed at Saddleback reads like a who&rsquo;s who of the motorcycle racing hall of fame&mdash;Ricky Johnson, Jeff Ward, Joel Robert, Roger DeCoster, David Bailey, Johnny O&rsquo;Mara, Gary Semics, and many more all raced at the famed track. Legends were made and unforgettable moments were etched into history through events that included the Trans AMA, Outdoor Motocross Nationals, World Mini GP, Flat Track races, and even some BMX events. Unfortunately, Saddleback was closed in 1984 due to liability lawsuits, and for the most part there isn&rsquo;t much left, as the 241 Toll Road now runs through a portion of it. But for those who have visited, and grew up twisting the throttle at Saddleback, the ghostly scars of portions of the track can still be seen winding up and down the rolling SoCal hills.</p>\r\n<p>We dug up this cool short video clip from When Rules Were Few and Saddleback Park was in its heyday.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 11, type: "DocumentPart::HtmlContent", title: "", content: "<p>There are certain events every year that are a must-attend on our list. Surfercross is one of them. A two-day get together of both the surfing and motocross communities; Surfercross lightheartedly pits surfers and motocrossers against each other over the course of two days&mdash;one at the moto track and the other at one of the most popular SoCal surf spots, San Onofre. Nearly 20 years ago, the event was created by current JGR/Suzuki team manager Jeremy Albrecht and has continued as a passion project for him. Today, it brings together a core group of surfers, riders, and industry insiders for some fun in the sun and dirt. Surfing and the SoCal scene have always been a part of what makes up Fasthouse, and we came on as the official apparal sponsor this year, bringing our own flare and good times along for the ride.</p>\r\n<p>After you're done with the video, <a href=\"http://www.thefasthouse.com/stories\">CLICK HERE</a> to check out the huge <a href=\"http://www.thefasthouse.com/stories\">FH Photo Story</a>.</p>\r\n<p><em>Photos by Max Mandell</em></p>\r\n<p><em>Video by Aran Eversman</em></p>\r\n<p><a href=\"/stories/surf-and-turf\"><img src=\"https://fasthouse.s3.amazonaws.com/media/uploads/btn-photostory.png\" target=\"_blank\" /></a></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 12, type: "DocumentPart::HtmlContent", title: "", content: "<p>If you've seen any of the Fast And Furious films then you've likely seen the work of our good friend, and incredible Hollywood stuntman, Corey Eubanks. But this particular stunt, which was featured in the opening sequence of Fast And Furious 5 is incredible. Check out the raw behind-the-scenes clip, and then <a href=\"https://www.youtube.com/watch?v=NY8IA3WF-Ts\">CLICK HERE</a> to watch the full scene and how it actually played out in the film.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 13, type: "DocumentPart::HtmlContent", title: "", content: "<p>We got our first introduction to the innovative Alta Redshift motorcycle this year at the Mammoth Motocross. We had some fun in front of our condo&mdash;it's quiet and our neighbors didn't mind... too much&mdash;before Darryn Durham got his first crack at riding the bike on a motocross track during practice the next day. To say he was blown away with the performance of the quiet machine would be an understatement. And since then, DD has been testing the Alta on a Supercross track. Although his plans for racing aboard the bike are still up in the air, it's safe to say he was blown away with the machine and how it handles a full-on professional level Supercross track.</p>\r\n<p><em>Photos and Video by Alta</em></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 14, type: "DocumentPart::HtmlContent", title: "", content: "<p>Both on his dirt bike, and when navigating the twisting SoCal canyon roads aboard his Cafe Racer, Fasthouse's Ricky Diaz is the epitomy of style. And in fact, when we first met him, it was his insane ability to throw his bike upside down that drew our attention. With the release of the new gear a couple weeks ago, ever the weekend warrior looking for a good time on two wheels, RD has been showing off at the local tracks on the weekends. \"I have ramp suspension on my bike right now,\" Diaz said. \"Riding on the tracks can be a little sketchy though (laughs).\" Good thing the stiff ramp suspension allows him to toss crazy whips. Click the link below to check out the full collection of new gear&mdash;jerseys, pants, and gloves.</p>\r\n<p><a href=\"https://store.thefasthouse.com/\">NEW GEAR AVAILABLE</a></p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 93, type: "DocumentPart::HtmlContent", title: "Red Bull Day In The Dirt 20", content: "<p>What began as a small gathering 20 years ago, Red Bull Day In The Dirt has grown into one of the largest events on the west coast, drawing thousands of spectators and riders from all across the U.S. and this year's event was nothing short of epic. Nearly every class was sold out and \"the fastest party in town\" delivered good times over the course of the Thanksgiving weekend. Friday began with Happy Hour practice and a short SoCal Reunion race followed by the 805 Friday Night Drag Races; which led into the weekend's racing, Hell On Wheels TT race, and the rad barn party where the Boogie Knights played for a packed house. If you missed this year, you missed the best DITD yet. Scroll through this huge FH Story to relive all the memories.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 93, type: "DocumentPart::HtmlContent", title: "Old Bikes And Premix", content: "<p>Every year, the weekend racing opens with the vintage bikes taking to the track before the FMF Two-Stroke Revival Race. Both races are some of the most entertaining of the weekend, and there really is nothing like the smell of premix in the morning.</p>", additional_data: {}, display_order: 7, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 93, type: "DocumentPart::HtmlContent", title: "805 Beer Friday Night Drags", content: "<p>Friday night marks the start of the good times with the 805 Beer Drags. It's a run-what-ya-brung good ol' fashion good time. Most of the racers just threw on a helmet and boots, swung a leg over their bike, and held it wide open through the pits, racing buddies to the checkered flag. This year's race was a little more organized than last year's, however, the overall winner was still a little unclear.</p>", additional_data: {}, display_order: 12, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 93, type: "DocumentPart::HtmlContent", title: "Hell On Wheels TT Flat Track", content: "<p>Even after the racing on the main track is over, there is always something going down at Day In The Dirt. Following Saturday's racing, Meatball and the Hell On Wheels crew throw a TT race followed by a flat track. Each race draws a plethora of different and interesting bikes, including Hooligan machines and just about any type of vintage bike you can imagine.</p>", additional_data: {}, display_order: 17, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 93, type: "DocumentPart::HtmlContent", title: "Barn Partying", content: "<p>The Saturday night Barn Party is usually packed, but this year's party was one for the books. Boogie Knights played a lengthy set for the packed barn and brought the house down with their energetic performance. And after 20 years of parties, this year's was easily the best yet.</p>", additional_data: {}, display_order: 22, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 93, type: "DocumentPart::HtmlContent", title: "Coup de Grace", content: "<p>It has always been the punctuation mark at the end of the long weekend, and the Coup de Grace survival race was just that. This year's race lasted an hour and a half and was won by Fasthouse rider Derek Kelly. For his efforts, Kelly was awarded a one-off painting by artist Chase Lock, which took weeks to create.</p>", additional_data: {}, display_order: 25, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 94, type: "DocumentPart::HtmlContent", title: "", content: "<p>In case you haven't noticed, there's a silent movement happening in the sport of motocross. Over the past few years, Alta has been making major strides in manufacturering a race-ready electric motocross bike. And after spending numerous days at the track with the Alta crew, Darryn Durham decided to put the machine to the test, racing in the annual TransWorld Motocross Slam event at Milestone MX Park. The Slam race is unlike any other, pitting 10 top pros against each other in two five-lap motos with the winner taking the $5,000 lion's share of the $10,000 pro purse. Practice for DD went relatively smoothly, as he went down a couple times while pushing the proverbial envelope aboard the Redshift, but in the end, he made it into the main event. Against the 10 other gas powered MX bikes, Darryn held his own, stayed out of trouble&mdash;for the most part&mdash;and turned in a solid finish in the Redshift's first official motocross race. The Redshift stood up to the abuse, proving that the future looks bright for the electric movement. Relive the weekend with some killer photos from the Alta crew.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 95, type: "DocumentPart::HtmlContent", title: "", content: "<p>There are certain events every year that are a must-attend on our list. Surfercross is one of them. A two-day get together of both the surfing and motocross communities; Surfercross lightheartedly pits surfers and motocrossers against each other over the course of two days&mdash;one at the moto track and the other at one of the most popular SoCal surf spots, San Onofre. Nearly 20 years ago, the event was created by current JGR/Suzuki team manager Jeremy Albrecht and has continued as a passion project for him. Today, it brings together a core group of surfers, riders, and industry insiders for some fun in the sun and dirt. Surfing and the SoCal scene have always been a part of what makes up Fasthouse, and we came on as the official apparal sponsor this year, bringing our own flare and good times along for the ride.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 95, type: "DocumentPart::HtmlContent", title: "Day One: Milestone MX", content: "<p>Surfercross is a team event, as the surfers and motocrossers are randomly paired up to compete in a team race and team surfing competition. The first day is when the teams are chosen randomly out of a hat, and it's where the surfers&mdash;who for the most part rarely ride&mdash;take their lives into their own hands, navigating the Milestone MX track. With temperatures hovering around triple digits, day one went off without a hitch and with a ton of smiles, laughs, and post-race bench racing.</p>", additional_data: {}, display_order: 3, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 95, type: "DocumentPart::HtmlContent", title: "Day Two: San Onofre State Beach", content: "<p>With everyone making it through the first day unscathed, the beach was a welcomed sight after the heat and dirt of Milestone. And after the challenging moto day for the surfers, it was the MXers' turn to look like rookies, floundering around in the surf. As was the case with the moto day, the surfing competition is held as a team event, as each team participates in heats together, working their way through elimination to the finals. In moto, the riders help the surfers with pointers, and in surfing, the surfers assist the riders with tips on catching waves. Some try to get some pre-comp practice, but there are the few that just wing it and it's often pretty comical.</p>", additional_data: {}, display_order: 10, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 96, type: "DocumentPart::HtmlContent", title: "", content: "<p>Now in it's 50th year, the Mammoth Mountain Motocross race is one of the longest running MX events in the United States. Each year, thousands of participants make the trek up the mountain for 10 days of racing, good times, and a little relaxation. This year, the Fasthouse crew went all out, debuting some rad new gear while showing everyone what it means to have a good times at the races. It isn't always about winning. For us, it's about the memories made and the lasting friendships that are cultivated through a mutual love of two wheel fun.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 96, type: "DocumentPart::HtmlContent", title: "Old Guys Hit The Track", content: "<p>The first weekend of competition is for vet racing. And due to the fact that everyone in attendance has to clock in for work on Monday, it's usually a more low-key atmosphere. In spite of that, though, it doesn't mean that the racing is any less entertaining&mdash;it's just a little safer and a little less risks are taken by the riders. Vet weekend also gives all the working class members of the Fasthouse crew a chance to let loose, twist the throttle, and relive their glory years.</p>", additional_data: {}, display_order: 3, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 96, type: "DocumentPart::HtmlContent", title: "Smoke And Fire", content: "<p>When rules were few and men rode heavy ill-handling pieces of machinery&mdash;those are the days we love to relive through the annual Smoke And Fire vintage race. This year's event was stacked with two gates and multiple classes lined up for battle. The smell of premix in the air and the sound of two-strokes echoing off the pine trees was music to our ears.</p>", additional_data: {}, display_order: 6, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 96, type: "DocumentPart::HtmlContent", title: "Silent Fun", content: "<p>During Thursday practice, our friends at Alta Motorcycles gave Darryn Durham a chance to spin some laps aboard their impressive electric motocross bike. Over the course of the practice session, DD got more and more comfortable as he silently ripped past riders and threw whips off the Mammoth Freeway table tops. \"I feel like I could almost go faster on that bike than my 450,\" he proclaimed at the conclusion of the joy ride.</p>", additional_data: {}, display_order: 9, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 96, type: "DocumentPart::HtmlContent", title: "Throwing Strikes", content: "<p>On track fun isn't all that the Mammoth Motocross has to offer. Not only does the mountain allow for all types of outdoor activities&mdash;fishing, mountain biking, and even skiing this year&mdash;but in conjunction with the event, Fasthouse and 805 Beer put on a rad bowling tournament on Thursday evening at the Rock And Bowl facility. Our own team may not have won, but if there were a competition for fun, we would've taken home the gold. Good times were had, cold 805s were consumed, and plenty of gutter balls were thrown.</p>", additional_data: {}, display_order: 12, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 96, type: "DocumentPart::HtmlContent", title: "The Big Show", content: "<p>With over 4,000 riders during the 10-day event, the final weekend easily drew the largest numbers, and our crew was well represented. Justin Hoeft, Darryn Durham, Kai Mukai, Deegan Vonlossberg, RJ Wageman, and Blayne Thompson all represented FH well in the stacked pro classes. In the pits, they were also well supported, as Thousand Oaks Motorsports and Twisted Development took care of the wrenching on the Gasper Racing machines that Hoeft and Durham competed on. In spite of not taking home the big wooden overall bear in the pro classes&mdash;that went to up-and-coming Yamaha rider Justin Cooper&mdash;our guys still looked the raddest, turned the most heads, and had the most fun.</p>", additional_data: {}, display_order: 15, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 96, type: "DocumentPart::HtmlContent", title: "Getting Sketchy", content: "<p>Every year, the race is capped off with some sort of sketchy team racing in the Mammoth Village on Saturday evening. Last year, it was downhill adult big wheel racing, but in previous years adult mini bike racing was held. After surprisingly making it through last year without any major injuries sustained on the big wheels, Mammoth promoters decided to bring back the mini bikes. It'll be safer they said... It'll be easier they said... With a snow triple, sketchy skateboard ramps, and metal rumble strip whoop sections, this year's mini bike race was anything but mellow and safe. When it was all said and done, though, only one racer limped away injured, and the Fasthouse team of Kai Mukai and Josh Kaller took home the coveted wooden bears.</p>", additional_data: {}, display_order: 22, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 97, type: "DocumentPart::HtmlContent", title: "", content: "<p>Amidst all the hussle and bussle of the factory teams meticulously tuning bikes and prepping for one of the most brutal Nationals of the entire year, the Fasthouse crew was tucked away in the back corner, minding our own business and quietly having a good time. This year's Glen Helen National was, as expected, one of the toughest races of the season, but it was also one of the most exciting for us. In his first-ever professional 450 race, Fasthouse's Justin Hoeft&mdash;aboard a mostly stock YZ450F&mdash;ran at the front of the pack, showed some factory riders how to twist the throttle, and ultimately finished a very impressive 11-14 for 14th overall. Before the main motos even got started, though, Ricky Diaz swung a leg over Wacker's bad ass YZ250 for the FMF Two-Stroke Invitational race. It was an epic Saturday filled with ice cold 805s and good times hanging over the fence, cheering for the boys. Scroll down to check out shots from the day.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 97, type: "DocumentPart::HtmlContent", title: "Black Betty", content: "<p>It's no secret, we love the smell of premix in the morning. And with the FMF Two-Stroke Invitational race being held in conjunction with the National, we had to get a bike and rider on the track. When it all came together at the last minute, Ricky Diaz didn't hesitate when he got the call to swing a leg over Wacker's tricked out YZ250, lovingly dubbed \"Black Betty\". Unfortunately for RD, though, after a good start a first lap crash relegated him to the back of the pack. Fortunately for the crowd, that meant his entire focus for the four-lap sprint was to throw massive whips off the humongous finish line triple.</p>", additional_data: {}, display_order: 7, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 97, type: "DocumentPart::HtmlContent", title: "From The Fence", content: "<p>If you've never experienced a professional outdoor motocross, you're sorely missing out. The television broadcast does no justice to the sheer gnarliness of both the track and the speed that these riders navigate it. Sipping a cold beer, covering it from roost, and hanging over the fence is the only way to truely experience these events. When it was time for the gate to drop for the main motos, the crew headed over to the Red Bull hospitality area to cheer on Hoeft in the 450 Class and Deegan Vonlossberg in the 250s.</p>", additional_data: {}, display_order: 10, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 97, type: "DocumentPart::HtmlContent", title: "Speed. Style. Good Times.", content: "<p>When the dust settled, the pits cleared out, and the last FH awning was thrown back in our van, the day was all about enjoying what we love&mdash;motorcycles, friends, and family. Motocross is a gnarly sport, but not only that, it brings people together in a common bond over two wheels and dirt. It's a bond that only the indoctrinated can fully understand.</p>", additional_data: {}, display_order: 14, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 98, type: "DocumentPart::HtmlContent", title: "", content: "<p>We race&hellip; sometimes. It&rsquo;s a mantra that we&rsquo;ve become known for&mdash;always in search of good times on two wheels, no matter if we&rsquo;re racing or not. This past weekend, though, we decided to round up the boys and head out to Glen Helen Raceway for some good old-fashioned racing at round three of the AMA District 37 Big 6 Series. And if you just read that wondering what the hell we&rsquo;re talking about, you&rsquo;re sorely missing out and in need of a massive wake up call.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 98, type: "DocumentPart::HtmlContent", title: "What's Most Important", content: "<p>This side of the Mississippi, the Big 6 Series is the largest amateur racing organization currently in operation, attracting thousands of entries each month and some of off-road&rsquo;s fastest professional racers. Not only does the series have classes for every single age, skill, and bike size, but it&rsquo;s also one of the most family-oriented camaraderie-driven organizations out there. Sure, there are the fast pros going for broke and earning a living, but the atmosphere at a Big 6 event harkens back to the days when riders would show up to Indian Dunes with nothing more than an ice chest of beer, a fueled up bike, and a fun-loving attitude. It&rsquo;s this that draws us to these events. Well&hellip; that and the fact that you truly get your money&rsquo;s worth with just a single hour-long race. No endless waiting between motos, wondering if you&rsquo;re race is going to go off the line before the sun goes down.</p>", additional_data: {}, display_order: 4, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 98, type: "DocumentPart::HtmlContent", title: "Big Time", content: "<p>With nearly 1,400 riders entered in the various classes on Saturday alone, this year&rsquo;s Glen Helen event drew a huge amount of riders and spectators. Included in that long list were Fasthouse&rsquo;s own Blayne Thompson, Sean Collier, Terry Cook, and more. Having not ridden much lately, Collier still elected to ride in the 30-Plus Class and the brutal Pro Race aboard his freshly rebuilt KX500. And even though he wasn&rsquo;t up front, he still had some fun aboard The Beast. As for Blayne&mdash;who won the opening round at Adelanto&mdash;he started near the front, but ultimately finished fifth in the Pro Race after some bad luck struck again in the form of a wheel malfunction. Up front in the same race, former Supercross racer turned off-roader Zach Bell ran away with the win aboard his OX Motorsports Honda. Behind him, Trevor Stewart brought his JCR Factory Honda across the line in second.</p>", additional_data: {}, display_order: 9, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 99, type: "DocumentPart::HtmlContent", title: "", content: "<p>Located in the small high-desert town of Adelanto, the annual District 37 Adelanto Grand Prix draws some of the biggest crowds and entries of the year, turning the normally sleepy town into a city full of racers, families, and fans looking for a good time. The race has some of the most diverse conditions around with everything from wide-open desert to motocross to Endurocross to the infamous Adelanto mud jump. This year was no different, and thanks to the torrential rainstorms that have been hammering Southern California recently, the conditions were perfect for dirt bike racing&mdash;nothing can beat freshly watered desert. And for the second year in a row, the Fasthouse crew made the trek up to the desert to race, spectate, and spread some good times.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 99, type: "DocumentPart::HtmlContent", title: "Pro Racing", content: "<p>The big pro race of the weekend was set to be held on Saturday afternoon, and it got off to a good start with Blayne Thompson opening up a sizeable lead in the Pro Class, while Willy Simons Jr. did the same in the Pro 2 Class. At the halfway mark, though, the race was red flagged due to an injured rider. And with the sun rapidly going down, the officials made the decision to restart the race on Sunday morning, giving the leaders a head start. Ultimately, both Blayne and Will were able to take the win in their respective classes, and with it the lion's share of the huge pro purse.</p>", additional_data: {}, display_order: 5, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 99, type: "DocumentPart::HtmlContent", title: "The Scene", content: "<p>If you haven't been to the Adelanto GP, you're missing out. The event has more of a carnival feel to it than a standard GP. The pits were absolutely packed all day; vendors were out in force, selling just about anything you could imagine; and 805 Beer was flowing freely next door to the Fasthouse rig.</p>", additional_data: {}, display_order: 10, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 100, type: "DocumentPart::HtmlContent", title: "", content: "<p>What began as a small gathering hosted by the Hollywood stunt and film community&mdash;and organized by Kenny Alexander and his wife Amber&mdash;19 years ago has blossomed into one of the biggest motorcycle gatherings west of the Mississippi. Every Thanksgiving weekend, thousands flock to Southern California for the annual Red Bull Day In The Dirt. And this year's event was one of the most memorable yet, as Mother Nature had her way of turning an already epic weekend into one filled with mud, adverse conditions, and even more fun. A photo is worth 1,000 words, and we're going to stop talking and just show you what went down.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 100, type: "DocumentPart::HtmlContent", title: "Friday Night 805 Drag Races", content: "<p>Backyard racing is where it all began. Who hasn't lined up with your buddies, dropped the clutch, and held the throttle on all in the name of glory? In honor of this time-honored tradition, 805, Hell On Wheels, and Fasthouse teamed up to bring a backyard-style drag race to the middle of pit row. To say it got sketchy would be an understatement...</p>", additional_data: {}, display_order: 5, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 100, type: "DocumentPart::HtmlContent", title: "Hands On Helmets", content: "<p>With rain in the forecast for Sunday, Saturday was the chance to get some racing in before the track got wet and things got slippery. As per usual, Fasthouse riders were at the front of the pack all throughout the day, with Trevor Stewart, Blayne Thompson, and Lil' Will Simons taking home the Bossa Nova three man team race win.</p>", additional_data: {}, display_order: 8, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 100, type: "DocumentPart::HtmlContent", title: "The Skies Open", content: "<p>Just as the weather man predicted, the skies opened up at 3:00 pm on Saturday and never really subsided for the rest of the weekend. The steady downpour forced the Hell On Wheels TT and Roland Sands Super Hooligan events to be held in the mud, making for some pretty rad photos. In spite of the wet weather, everyone still had ear-to-ear grins when they pulled off their helmets and reached for a cold one.</p>", additional_data: {}, display_order: 12, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 100, type: "DocumentPart::HtmlContent", title: "Day In The Mud", content: "<p>It rained all night, but Kenny Alexander and the crew worked tirelessly to get the track ready for the final day of racing. After scouting the ridgeline at 3:00 AM, they got to work, re-routing the track and prepping it before more rain hit just before the Moto A Go-Go team race. Once the downpour began, though, all bets were off&mdash;Glen Helen turned into a soupy mess.</p>", additional_data: {}, display_order: 16, hidden: nil, created_by: nil, pane: "main"},
