  {document_id: 102, type: "DocumentPart::HtmlContent", title: "", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 103, type: "DocumentPart::HtmlContent", title: "", content: "", additional_data: {}, display_order: 0, hidden: nil, created_by: nil, pane: "left"},
  {document_id: 104, type: "DocumentPart::HtmlContent", title: "", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 105, type: "DocumentPart::HtmlContent", title: "", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 104, type: "DocumentPart::HtmlContent", title: "", content: "In case you haven't noticed, there's a silent movement happening in the sport of motocross. Over the past few years, Alta has been making major strides in manufacturering a race-ready electric motocross bike. And after spending numerous days at the track with the Alta crew, Darryn Durham decided to put the machine to the test, racing in the annual TransWorld Motocross Slam event at Milestone MX Park. The Slam race is unlike any other, pitting 10 top pros against each other in two five-lap motos with the winner taking the $5,000 lion's share of the $10,000 pro purse. Practice for DD went relatively smoothly, as he went down a couple times while pushing the proverbial envelope aboard the Redshift, but in the end, he made it into the main event. Against the 10 other gas powered MX bikes, Darryn held his own, stayed out of trouble—for the most part—and turned in a solid finish in the Redshift's first official motocross race. The Redshift stood up to the abuse, proving that the future looks bright for the electric movement. Relive the weekend with some killer photos from the Alta crew.", additional_data: {}, display_order: 1, hidden: false, created_by: nil, pane: "main"},
  {document_id: 106, type: "DocumentPart::HtmlContent", title: "John Hateley", content: "<p>Actually John started working in films as an actor at the age of three, but by the age of ten his energy and passion had turned to motorcycles. In 1966 at fourteen he won the AMA District 37 100cc TT Championship. At fifteen he was holding his own with the fastest racers in So Cal. Racing was born and bred into him.</p><p>Back in the 70’s it was hard to make a living as a racer despite being one of the fastest pros in the country. So he came full circle, going back into film work, this time as one badass stuntman. But that competitive fire never goes out, as good friend and fellow stuntman Gene Hartline says about John, “He’s a racer. If you want a definition of what that is, he’s it, he’ll race you to the bathroom.”</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 107, type: "DocumentPart::HtmlContent", title: "", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 108, type: "DocumentPart::HtmlContent", title: "", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 109, type: "DocumentPart::HtmlContent", title: "", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 110, type: "DocumentPart::HtmlContent", title: "Sean Collier", content: "Superfast dirt bike rider and local boy, Sean lives in our hometown, Newhall, California. If you have ever had the pleasure of watching him on a motocross course you’ll know what we’re talking about he’s got the flow. He’s on the team.", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 111, type: "DocumentPart::HtmlContent", title: "", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 112, type: "DocumentPart::HtmlContent", title: "Ryan Penhall", content: "<p>A second-generation motorcyclist, Ryan Penhall grew up around two-wheels, as his dad Bruce was once a successful Speedway racer, winning two world championships in 1981 and 1982. </p><p>When he isn’t on his bike, he works at the family business, Conner Concrete Cutting, which was named in honor of his younger brother Conner who passed away three years ago. If you ask Ryan, though, his true passion, and when he feels the most relaxed, is when he’s away from work with his dirt bike beneath him.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 113, type: "DocumentPart::HtmlContent", title: "Mic Rogers", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 114, type: "DocumentPart::HtmlContent", title: "Ricky Diaz", content: "The first time we met Ricky, of course, was at a local track – Milestone. We loved his style and we got to know him pretty well that day. He’s been one of us ever since, a So Cal local. The kid can throw it down.", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 115, type: "DocumentPart::HtmlContent", title: "Ricky Johnson", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 116, type: "DocumentPart::HtmlContent", title: "Terry Cook", content: "Terry Cook tells it like it is, he pushes the limits, and has that moto attitude. It serves him well, whether he’s racing his dirt bike or his mountain bike. This attitude we love so much is one of calm confidence and a belief in excellence, that’s Terry Cook personified.", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 117, type: "DocumentPart::HtmlContent", title: "Willy Simons Jr.", content: "Willy Jr. was born with moto DNA in his blood, handed down from his dad Willy Simons Sr. He calls Simi Valley his home, but he mostly lives in the dirt of So Cal's many motocross venues. Keep an eye on this kid, he's one of our moto crew.", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 118, type: "DocumentPart::HtmlContent", title: "Brian Palmer", content: "We’ve known Brian for years, he’s the realtor to most of the motoheads we know. And he’s been a fixture at the dirt bike race we put on called Day in the Dirt. He always has something smart to say, makes us love his style and his sense of humor. Brian and Tami are our kind of people.", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 119, type: "DocumentPart::HtmlContent", title: "Robbie Wageman", content: "Robbie lives in our hometown, Newhall, CA. The Wageman moto family has made its mark here. Rob Dog, as his friends call him, is one of fastest young racers around. You can find him tearing up the local tracks around So Cal and competing in some of the biggest and coolest races in the U.S. He is one of our local boys.", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 120, type: "DocumentPart::HtmlContent", title: "RJ Wageman", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 121, type: "DocumentPart::HtmlContent", title: "Darryn Durham", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 122, type: "DocumentPart::HtmlContent", title: "Tyler Bereman", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 123, type: "DocumentPart::HtmlContent", title: "Tony Parks", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 124, type: "DocumentPart::HtmlContent", title: "Blayne Thompson", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 125, type: "DocumentPart::HtmlContent", title: "Tommy Nagy", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 126, type: "DocumentPart::HtmlContent", title: "Lance Sloan", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 127, type: "DocumentPart::HtmlContent", title: "Danny Osterman", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 128, type: "DocumentPart::HtmlContent", title: "Max Mandell", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 129, type: "DocumentPart::HtmlContent", title: "Dave Castillo", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 130, type: "DocumentPart::HtmlContent", title: "Pat “P-Lo” Lopez", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 131, type: "DocumentPart::HtmlContent", title: "Steve Shearer", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 132, type: "DocumentPart::HtmlContent", title: "Leticia Cline", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 133, type: "DocumentPart::HtmlContent", title: "Caile Noble", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 134, type: "DocumentPart::HtmlContent", title: "Talon Hawkins", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 135, type: "DocumentPart::HtmlContent", title: "Andrew Hertzler", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 136, type: "DocumentPart::HtmlContent", title: "Brendan Lutes", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 137, type: "DocumentPart::HtmlContent", title: "Riley Harper", content: "Riley Harper is living the dream. He is following his father’s footsteps (Tom Harper) not only in the film industry but also in his love of motorcycles. Riley works around the world as a stuntman, lives in So Cal, rides with his buddies at the local moto tracks, and you can find him most weekends tearing down Mulholland on his Triumph.", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 138, type: "DocumentPart::HtmlContent", title: "Reid Harper", content: "The Harper DNA is loaded with dirt bike and racing genes, and Reid’s got his share. &nbsp;His love of motorcycles has taken him down the coast of Baja and to all the local So Cal motocross tracks.  Reid has also joined the Harper family business, stunts.  And the cool thing is, he’s part of our moto crew.", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 139, type: "DocumentPart::HtmlContent", title: "Tom Harper", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 140, type: "DocumentPart::HtmlContent", title: "Deegan Vonlossberg", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 141, type: "DocumentPart::HtmlContent", title: "Gage Schehr", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 142, type: "DocumentPart::HtmlContent", title: "Tyler \"T-Mac\" McCaul", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 143, type: "DocumentPart::HtmlContent", title: "Ryan “R-Dog” Howard", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 144, type: "DocumentPart::HtmlContent", title: "Austin “Bubba” Warren", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 145, type: "DocumentPart::HtmlContent", title: "Emil Johansson", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 146, type: "DocumentPart::HtmlContent", title: "Caroline Buchanan", content: "<p>Fasthouse welcomes Lifestyle/BMX/MTB global athlete Caroline Buchanan (Australia) to the team.</p><p>Mike Redding stated, “We are stoked to have Olympian and multiple World Champion Caroline on the team doing lifestyle projects and riding at global events for us. She will also help us design our women’s line in the future. She fits our brand vibe: Speed, Style, and Good Times!”</p><p>Caroline will be at select BMX and MTB events, and bike parks around the world.</p><p>Go to Fasthouse.com and check out our current lifestyle clothing line. Keep an eye out for our MTB line and Bell helmets co-lab dropping this spring. Give Caroline a follow on her IG account&nbsp;<a target=\"_blank\" rel=\"nofollow\" href=\"https://www.instagram.com/cbuchanan68/\">@cbuchanan68</a>.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 147, type: "DocumentPart::HtmlContent", title: "", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 148, type: "DocumentPart::HtmlContent", title: "Ricky Johnson", content: "Racer/Racer, Rick Johnson. We are proud of the fact that we are friends with Ricky. Yes, he’s a multi-time champion, not only on two wheels but also on four. But for us, he helped make an event we put on once a year called A Day in the Dirt so cool. In 1998 Ricky came to LACR for the first one and partnered up with legendary desert racer, J.N. Roberts for the team race. That was a huge deal for us. And he’s been with us ever since, we love the bad boy of motocross.", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 149, type: "DocumentPart::HtmlContent", title: "Doug Henry", content: "Doug Henry personifies “Badass”. One of the greatest dirt bike racers ever, his talents being right up there with the greats. His career spans super highs with big wins in motocross and supercross and devastating lows with injuries culminating with a spinal cord injury resulting in partial paralysis. But Doug Henry is unstoppable, he continues to ride and race on his custom built dirt bike, that’s where he finds his “happy place.” He is the epitome of a true racer. He’s one of our heroes.", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 150, type: "DocumentPart::HtmlContent", title: "Roger De Coster", content: "If someone in the world of motocross mentions “The Man” you know they’re talking about Roger. He is perhaps the best-known racer from the first 50 years in the sport of motocross. Born in Belgium, Roger came late into riding, getting his first race bike at 17. But he was born with the racing DNA, by 19 he had won the junior 500cc Belgium Motocross title, the Belgium Trials championship, and earned a gold in the ISDT. It was onward and upward from there, winning so many titles it’s impossible to list them here. America got to meet Roger for the first time in 1967 when Jim McKay interviewed him on Wide World of Sports at the famous Hopetown Grand Prix in Simi Valley, California. Back in SoCal today, he is still a force to be reckoned with, he is Team Manager of the Red Bull KTM Factory Team in the U.S. A true legend, “The Man”.", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 151, type: "DocumentPart::HtmlContent", title: "", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 152, type: "DocumentPart::HtmlContent", title: "Mert Lawwill", content: "Mert is remembered most for the role he played in Bruce Brown’s iconic “On Any Sunday.” The film turned the world onto TT racing where Mert was king, winning 17 National Championships. Mert’s contribution to mountain bikes and prosthetics for racers is supercool.", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 153, type: "DocumentPart::HtmlContent", title: "Joel Robert", content: "<p>For most Americans, the first time we laid eyes on Belgian rider Joel Robert (pronounced RoBear) was in 1967 when he was racing the Classic Hopetown Grand Prix in southern California, filmed by Bruce Brown and shown on ABC's Wide World of Sports.</p><p>Robert was a bigger than life character, unbelievably fast, eccentric, undisciplined, and a charming prankster. He won 6 World Championships, 5 in a row. He loved his beer and smoked, often while sitting on the line waiting for the start, and as the story goes on one of these occasions he put the cig out on the helmet of the rider next to him. He then proceeded to win the race.</p><p>Stories abound, all of them reinforcing our belief that Joel Robert is – the Godfather of Motocross.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 154, type: "DocumentPart::HtmlContent", title: "Kenny Zahrt", content: "<p>“Man, motocross for me has been my life – it’s all I know, and still all I do! I have always been around motorcycles, worked on motorcycles and ridden motorcycles. That’s it, that’s what I did and still do!” So Cal born, local boy at Indian Dunes, he was one of the most colorful and cool characters racing motocross and supercross.</p><p>In 1974 he won a National at Redbud on a Bultaco and in 2013, still living the life, he raced at Red Bull Day in the Dirt 16.</p><p>Kenny passed away Friday, November 14th, 2014. He is missed. </p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 155, type: "DocumentPart::HtmlContent", title: "", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 156, type: "DocumentPart::HtmlContent", title: "", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 157, type: "DocumentPart::HtmlContent", title: "", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 158, type: "DocumentPart::HtmlContent", title: "", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 159, type: "DocumentPart::HtmlContent", title: "Malcolm Smith", content: "<p>Possibly one of the coolest scenes in the best motorcycle movie ever made, “On Any Sunday” was Malcolm Smith roaring back into town In the Elsinore Grand Prix. He was alone, not one of the other 1499 riders was in sight.</p><p>1998 AMA Hall of Famer, Malcolm was a classic example of a Sunday motocross competitor. Fast, furious and tireless, he was the “best of the best” and it earned him a starring role in Bruce Brown’s, “On Any Sunday.” His talent was unmatched, the rougher and tougher the event, the more Malcolm shined. He knew how to hang it out with a style all his own, cool, calm, collected and grinning ear to ear.</p>", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 160, type: "DocumentPart::HtmlContent", title: "Dave Ekins", content: "Dave was a true pioneer. Just the name Ekins alone (Dave or brother Bud), reverberates through the motorcycle racing community. Dave was cutting new trails whether it was through the hills from Mulholland to the ocean or 1000 miles across the Mexican desert from Tijuana to La Paz. Thank you for leading the way.", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 161, type: "DocumentPart::HtmlContent", title: "", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 162, type: "DocumentPart::HtmlContent", title: "", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 163, type: "DocumentPart::HtmlContent", title: "", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 164, type: "DocumentPart::HtmlContent", title: "Torsten Hallman", content: "Torsten Hallman was one of the Europeans who came to challenge the Americans at the legendary Hopetown Grand Prix in 1967, and introducing motocross to the United States. He was perhaps the best Swedish rider ever, winning four Motocross World Championships. Going from a world champion racer to a world-class businessman, he created THOR (Torsten Hallman Original Racewear). It became one of the leading racing apparel companies in the world. For sure, Mr. Motocross.", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 165, type: "DocumentPart::HtmlContent", title: "Bruce Brown", content: "A Fasthouse friend and hero, he made undoubtedly the best and most influential motorcycle documentary ever, On Any Sunday. But he first brought motorcycle racing to a vast audience on Wide World of Sports when he filmed the legendary Hopetown GP in 1967. With more that 30,000 at the track and millions watching the TV, Bruce captured the essence of a new and exciting style of motorcycle racing, motocross. He helped make the sport we love so cool.", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 166, type: "DocumentPart::HtmlContent", title: "Steve McQueen", content: "Steve McQueen was called “The King of Cool,” he was a motorcycle racer and a movie star. If you’re not too familiar with him, just know that he always carried himself with style, grace, and the confidence of a champion. Motorcycle racing was his passion acting was his profession. Indian Dunes located just a few miles north of Hollywood is where Steve spent most of his weekends. And after riding all day he cruised just down the road to the original Fasthouse to kick it back, have a beer and tell war stories. We love Steve.", additional_data: {}, display_order: nil, hidden: false, created_by: nil, pane: "main"},
  {document_id: 167, type: "DocumentPart::HtmlContent", title: "", content: "", additional_data: {}, display_order: 1, hidden: nil, created_by: nil, pane: "main"},
  {document_id: 168, type: "DocumentPart::HtmlContent", title: "Footer", content: "\r\n    <div class=\"row\">\r\n        <div class=\"col-lg-5 col-md-4 footer-left\">\r\n            <h3><img src=\"http://thefasthouse.com/static/img/fasthouse-logo-white.png\" alt=\"Fasthouse\"></h3>\r\n            <p class=\"footer-links\">\r\n\t\t\t\t<a href=\"/\">Home</a> · \r\n\t\t\t\t<a href=\"http://store.thefasthouse.com/\">Store</a> · \r\n\t\t\t\t<a href=\"/the-scene\">The Scene</a> · \r\n\t\t\t\t<a href=\"/videos\">Videos</a> · \r\n\t\t\t\t<a href=\"/subscribe\">Subscribe</a> · \r\n\t\t\t\t<a href=\"/crew\">Crew</a> · \r\n\t\t\t\t<a href=\"/legends\">Legends</a> · \r\n\t\t\t\t<a href=\"/when-rules-were-few\">History</a></p>\r\n            <p class=\"footer-links\"><a href=\"http://store.thefasthouse.com/pages/privacy-policy\">Privacy</a> · <a href=\"http://store.thefasthouse.com/pages/terms-conditions\">Terms</a></p>\r\n            <div class=\"footer-icons\"><a href=\"http://www.facebook.com/fasthousebrand\" target=\"_blank\"><i class=\"fa fa-facebook\"></i></a>&nbsp; <a href=\"http://instagram.com/fasthouse_\" target=\"_blank\"><i class=\"fa fa-instagram\"> </i></a>&nbsp; <a href=\"https://www.youtube.com/user/elrodracing/featured\" target=\"_blank\"><i class=\"fa fa-youtube\"></i></a></div>\r\n        </div>\r\n        <div class=\"col-md-4 footer-center\">\r\n            <table>\r\n                <tbody>\r\n                    <tr>\r\n                        <td><i class=\"fa fa-map-marker\"></i></td>\r\n                        <td>26525 Ruether Ave.<br>Santa Clarita, California, USA 91350</td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td><i class=\"fa fa-phone\"></i></td>\r\n                        <td>661.347.7950</td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td><i class=\"fa fa-dot-circle-o\"></i></td>\r\n                        <td><a href=\"/fasthouse-dealers\">Find a Dealer</a><